INSERT INTO public.products VALUES (307, 'LeBron James Autographed & Inscribed Game-Used Nike LeBron 11 Shoes (vs. Nuggets 3/14/14), 1 of 1', 49994.99, '2025-04-25 07:27:16.129454', 'Here is a unique opportunity to own a pair of game-used basketball shoes from one of the greatest basketball players to ever lace up a pair of high tops. LeBron James autographed and inscribed these white, black and red Nike LeBron 11 shoes from the 2014 season with the Miami Heat. This pair of shoes was worn by James during his record-setting run in South Beach. This 1-of-1 pair has been autographed on the right shoe with a hand-written inscription on the left. They were worn in a game against the Denver Nuggets on 3/14/14 in which James scored 21 points with six rebounds and six assists and three steals in a 111-107 home loss. The Heat went on to make their fourth consecutive NBA Finals appearance that season, falling just short of winning their third straight title. James has autographed and inscribed “vs. Nuggets 3/14/14” on this limited edition (1) pair of game-used Nike shoes in black paint pen. His signature is deemed authentic by virtue of Upper Deck Authenticated’s Five-Step Process.', './assets/uploads/images/113.jpg', true, 'active', false);
