INSERT INTO public.products VALUES (547, 'Canon EOS R50 Mirrorless Digital Camera Body Black with Canon RF-S 18-45mm f/4.5-6.3 is STM Lens 3 Lens Kit with Complete Accessory Bundle + 64GB + Flash & More - International Model (64gb Kit)', 759.95, '2025-04-25 07:27:16.129454', 'Introducing the compact and lightweight EOS R50 camera, perfect for capturing beautiful images effortlessly. With intuitive photo functions and 6K oversampled 4K 30p video capture, it''s ideal for both photography and vlogging. The 24.2 Megapixel APS-C CMOS sensor and DIGIC X processor ensure high-quality images in various lighting conditions. Featuring a flexible ISO range of 100-32000, expandable to 51200. The camera offers a 2.36m-dot EVF and vari-angle touchscreen LCD for easy shooting from different angles. Built-in Bluetooth and Wi-Fi connectivity allow seamless connection to smart devices via Canon Camera Connect app. The kit includes the Canon RF-S 18-45mm f/4.5-6.3 IS STM lens, providing a wide-angle to short telephoto zoom range with optical IS image stabilization and smooth, silent focusing.', './assets/uploads/images/383.jpg', true, 'active', false);
