INSERT INTO public.products VALUES (552, 'Vintage Home Artificial Real Touch 5.08 Feet Palm Tree with Fiberstone Planter', 422.47, '2025-04-25 07:27:16.129454', 'Vintage Home provides a versatile accent plant ideal for homes or offices, doubling as a great gift for housewarmings or grand openings. Its measurements are taken from the bottom of the planter to the furthest extended flower or leaf, with width dimensions calculated from each furthest outstretched point. This maintenance-free plant stays fresh without watering and requires only a soft dry cloth for cleaning. Crafted with meticulous attention to detail, Vintage Home''s lifelike plants and trees elevate the decor of any room.', './assets/uploads/images/388.jpg', true, 'active', false);
