INSERT INTO public.products VALUES (562, 'Miele Classic C1 Turbo Team Bagged Canister Vacuum, Tech Blue - Portable, Household', 469.00, '2025-04-25 07:27:16.129454', 'GERMAN ENGINEERED: Bagged canister vacuum cleaner ideal for homes with hard floors and low-medium pile carpeting STRONG SUCTION POWER: Switch between 6 suction power settings specific to the surface being cleaned MAXIMUM MANEUVERABILITY: Vacuum easily around and underneath furniture, or use the clipped on accessories to clean upholstery or hard to reach places AIRCLEAN SYSTEM: Miele''s unique 3-tiered filtration system consists of a genuine Miele FilterBag, Motor Protection Filter and AirClean Exhaust Filter. The room air is cleaner after vacuuming than before INCLUDED ACCESSORIES: STB 305-3 TurboTeQ Floorhead, SBB Parquet-3 Floorhead, Dusting Brush, Crevice Tool and Upholstery Tool', './assets/uploads/images/400.jpg', true, 'active', false);
