INSERT INTO public.products VALUES (564, 'SE ELECTRONICS - sE8 Small Diaphragm Condenser Microphone with Mounting and Case, Factory Matched Pair', 545.00, '2025-04-25 07:27:16.129454', 'Gold-sputtered diaphragms ensure maximum reliability Every capsule is handcrafted and individually tuned Ultra-precision electrode design optimized for superb linearity and natural sonics Ultra-thin 3 micron gold-sputtered diaphragm for superior transients Sophisticated acoustic design with precision components Fit for any challenges in the studio or on stage, the sE8 is a brand new high-performance handcrafted small-diaphragm condenser, fresh from the labs at sE Its new hand-made capsule implements a sophisticated backplate design that provides a perfectly balanced sound, so it''s never harsh or aggressive - perfect for sources like high-hats and drum overheads It''s also one of the quietest small-capsule mics on the planet - and with the highest dynamic range and SPL handling in its class, along with attenuation pads and low-cut filters for superb flexibility, the sE8 is ready for any sounds you’re making, whether in the studio environment or demanding on-stage applications Two Switchable Pre-Attenuation Pads The -10 dB and -20 dB pad switches provide extended dynamic range, enabling a wide range of applications and close-mic techniques for brass instruments, snare drums, and more', './assets/uploads/images/404.jpg', true, 'active', false);
INSERT INTO public.products VALUES (565, 'AZULLE Access4 Pro Zoom Mini PC Stick 4GB/64GB – Business & Home Video Powerful Portable Computer with Ethernet Port- Gemini Lake J4125 Processor', 329.99, '2025-04-25 07:27:16.129454', 'BUSINESS & HOME: Powered by the Powerfull Gemini Lake J4125 Processor, the Access4 is a cost-efficient desktop replacement solution for the home or office. With just one Zoom license you can expand your reach across your company or enjoy video conferencing with your family as a remote management product.', './assets/uploads/images/405.jpg', true, 'active', false);
INSERT INTO public.products VALUES (566, 'FORSPARK Camera Dehumidifying Dry Cabinet |15W 125L-Noiseless & Energy Saving - for Camera Lens & Electronic Equipment Storage Black', 560.99, '2025-04-25 07:27:16.129454', 'Efficient Dehumidification: FORSPARK dry cabinet features quick, quiet, and heatless thermoelectric cooling technology to protect electronic equipment. Safe & Economical: Direct current input ensures safety with no leakage risks or fire danger. Energy-saving mode uses only 15 watts. Accurate Humidity Control: Built-in hygrometer offers precise control from 25% to 60% humidity with ±5% accuracy. Easy to Use: Begins working instantly upon power supply. Adjustable shelves for storage, LED light with brightness control, and durable toughened glass door. Wide Application: Preserves various items like camera lenses, paintings, stamps, books, and more. Just set the desired humidity level and store valuables.', './assets/uploads/images/406.jpg', true, 'active', false);
