INSERT INTO public.products VALUES (618, 'Dunlop Stringing Machine 3.0 (Diablo Gripper)', 8749.99, '2025-04-25 07:27:16.129454', 'The Dunlop Stringing Machine 3.0, equipped with the Diablo Gripper, offers exceptional precision, accuracy, and speed in a highly mobile and compact design, ideal for tournaments or on-the-go stringing. Its single-person setup capability, tabletop compatibility, and efficient storage features like a main drawer and tool holder ensure convenience. The Diablo Gripper''s 20-degree angle facilitates a gentler stringing process, while the display provides precise tension readings in both kilograms and pounds. Additional functions include pre-stretch and knot options, a precision metal brake, mute feature, and modes for tennis or badminton stringing. With newly designed clamps and a comprehensive tool kit, including adapters for various sports, it''s a complete solution for professional stringing needs.', './assets/uploads/images/460.jpg', true, 'active', false);
INSERT INTO public.products VALUES (619, 'GOWE Button U Design Automatic Four Stations Heat Press Machine for Cloth.', 8520.00, '2025-04-25 07:27:16.129454', 'The GOWE Button U Design Automatic Four Stations Heat Press Machine by Gowegroup is expertly engineered for high-quality garment printing. With four stations for simultaneous printing, it enhances productivity. Its innovative "Button U" design ensures easy operation, while automatic functionality streamlines the printing process. The heat press mechanism delivers durable and vibrant prints on clothing. With a voltage of 230 Volts, it''s a reliable choice for professional printing tasks.', './assets/uploads/images/461.jpg', true, 'active', false);
