INSERT INTO public.products VALUES (673, 'Devon Tread1 E Men''s Time Belt Microstep Motor Watch', 18500.00, '2025-04-25 07:27:16.129454', 'Devon is a reinvention of the watch. The Tread 1, daring and inventive, represents the exploratory American spirit. The exposed movement is a mesmerizing display of the patented interwoven system of conveyor belts. This series of belts includes critical elements that allow the optical recognition system to know every belt position at all times. While the watch is loud, Devon does include a “quiet mode.” In this mode the watch stops showing the time and goes silent. Internally it still tells the time, but doesn’t show it until you de-activate quiet mode Reading the time and wearing the watch is pretty easy. The wide strap and unique buckle are cool to say the least. Operating the Tread 1 is also pretty simple once you read the instructions. The watch runs off a lithium polymer battery that lasts about two weeks during normal use. You don’t replace the battery regularly but rather charge it. To do this Devon includes a magnetic induction charger that you simply place the watch on top of. The seconds belts also doubles as a battery life indicator', './assets/uploads/images/517.jpg', true, 'active', false);
