INSERT INTO public.products VALUES (746, 'Tommy Hilfiger Men''s Quartz Stainless Steel and Leather Strap Casual Watch', 115.50, '2025-04-25 07:27:16.129454', 'Tommy Hilfiger Watches – Classic, American, Cool It was only a matter of time before Tommy Hilfiger took on the world of watches. Inspired by his father who worked 42 years as a watchmaker in the jewelry business, Tommy Hilfiger was driven to design his own watch collection. Putting his extraordinary talents and infallible fashion instincts to the test, Tommy Hilfiger stepped into the role of watch designer. His goal was to offer the precise, reliable performance of a quality timepiece as well as the classic American style for which his sportswear was so well known. Hilfiger set out to create fashion watches of unmistakable style and exceptional value, and that’s exactly what he did. In 1999.', './assets/uploads/images/1307.jpg', true, 'active', false);
INSERT INTO public.products VALUES (729, 'Lightspeed Delta Zulu™ ANR Aviation Headset - Premium Noise Canceling Bluetooth Headset for Pilots with Built-in Carbon Monoxide Monitoring and Personalized EQ (GA Dual Plugs)', 1210.00, '2025-04-25 07:27:16.129454', 'Superior Quiet: Advanced active noise reduction (ANR) performance over a deep, broad range of low-frequency noise for a more comfortable flying experience. Carbon Monoxide Sensor: Built-in Kanari smart alert technology measures aircraft cabin carbon monoxide levels and provides audible and visual warnings at preset CO thresholds. Integrated App: Lightspeed''s app smoothly integrates key features CO monitoring, personalized EQ settings, and conversation recording. Customized Hearing: By taking a 12-frequency hearing test in the new Lightspeed app, HearingEQity automatically adjusts your Delta Zulu to optimize every ATC call and conversation specifically for your individual hearing profile. Superior Quiet: Advanced active noise reduction (ANR) performance over a deep, broad range of low-frequency noise for a more comfortable flying experience). Connect to More: Connect directly to other devices for charging, audio, and data transmission via UAC, USB-A, USB-C, 3.5 mm, Lightning plugs, or Bluetooth. Durability & Longevity: Made almost entirely of stainless steel and magnesium with durable cables built around a Kevlar core, the Lightspeed Delta Zulu is designed to endure the harshest flying environments and last for years to come. Industry-Leading 7-Year Manufacturer''s Warranty: Lightspeed stands by the quality of the Lightspeed Delta Zulu with a comprehensive 7-year warranty of materials and workmanship.', './assets/uploads/images/575.jpg', true, 'active', false);
INSERT INTO public.products VALUES (730, 'Steelcase Gesture Office Chair - Ergonomic Work Chair with Wheels for Carpet - Comfortable Office Chair - Intuitive-to-Adjust Chairs for Desk - 360-Degree Arms - Licorice Fabric', 1424.00, '2025-04-25 07:27:16.129454', 'Ergonomic Chair Design: The Gesture chair by Steelcase is expertly designed to redefine the relationship between you and your chair, adjusting to your unique body and work posture Comfortable Desk Chair for Extended Use: The Gesture chair is designed for a variety of users and postures, ideal for those who prioritize a precise fit and sit for long periods of time Premium Office Furniture Features: This chair includes wheels for carpet, 360-degree arms, a contoured back that fits your spine''s natural shape, and intuitive adjustments all located on the right side within arms reach High-Quality Chair for Desk: The Gesture chair boasts a full recline range with three settings, an upright back lock, and intuitive adjustment mechanisms Better Design, Better Comfort, Better Choice: Our high performance seating helps you do your best work; we offer a broad range of dynamic options, all backed by Steelcase research, innovation, and our unwavering standards for quality and sustainability', './assets/uploads/images/576.jpg', true, 'active', false);
INSERT INTO public.products VALUES (731, 'NexiGo Aurora Pro Bundle, Ultra Short Throw 4K Tri-Color Laser TV, Home Theater Laser TV, with 120" Fresnel Screen/AS400 Motorized Lifting Slide/DLP Link 3D Glasses (2Pack)', 6076.99, '2025-04-25 07:27:16.129454', 'The Aurora Pro projector offers exceptional out-of-the-box color accuracy across four screen options, minimizing the need for professional calibration. Enjoy immersive cinematic sound with built-in 60W stereo speakers, Dolby Atmos support, and Active 3D compatibility. The NexiGo ALR screen blocks 85% of ambient light for vibrant, high-contrast display. Enhance your experience with Active Shutter 3D Glasses, compatible with DLP-LINK projectors. Save space with the NexiGo Lifting Slider Tray, extending ultra-short throw projection up to 150.', './assets/uploads/images/577.jpg', true, 'active', false);
INSERT INTO public.products VALUES (732, 'Trinity Church Supply Saint Joseph with Child Statue Religious Collectible Figurine Christian Decor Devout Gift for Patio Lawn Yard Porch Decorations, 48 Inch Height', 1239.88, '2025-04-25 07:27:16.129454', 'European Church Art: Inspired by the rich tradition of European church art, this statue embodies the timeless beauty and reverence found in classic wood sculptures, making it a perfect addition to any religious setting. Exquisite Craftsmanship: Standing tall at 48 inches, this statue of Saint Joseph and the child Jesus is meticulously handcrafted by skilled artisans, capturing every intricate detail with precision and care. Perfect for Sacred Spaces: Whether adorning the altar of a church or the quiet corner of a chapel, this exclusive statue from Milagros adds a touch of reverence and grace to any religious environment. Vibrant Colors: Each stroke of the carver''s blade is highlighted with vibrant oils, ensuring that this resin replica retains the lifelike appearance and texture of the original wood carving. Durable Resin Material: Made from sturdy resin, this statue is built to last, providing a long-lasting symbol of faith and devotion for generations to come.', './assets/uploads/images/578.jpg', true, 'active', false);
