INSERT INTO public.products VALUES (736, 'LLADRÓ an Afternoon Nap Mother Figurine. Porcelain Mother Figure.', 1026.00, '2025-04-25 07:27:16.129454', 'HANDMADE IN SPAIN: The highest-quality pieces handcrafted in Valencia, in the only LLADRÓ factory in the world. A team of expert artists and designers keep alive ancestral trades and techniques to turn porcelain into dreams. Sculptors, ornamenters, technicians, painters are all involved in the craftsmanship process... An endless number of hands that, one by one, leave their mark, an almost imperceptible imprint, making each artwork UNIQUE and EXCLUSIVE. BEAUTY AND SUSTAINABILITY: Our goal is always to create beauty from a place of sustainability and respect, principles that are part of the brand’s DNA. Lladró respects all the resources involved in the process of creating, making and selling our porcelain artworks, to offer a BEAUTIFUL, SUSTAINABLE and DURABLE product. QUALITY AND EXCELLENCE: The pursuit of perfection is not only part of the process of designing and creating the pieces, but also extends to quality control, where the finished SCULPTURE undergoes various tests to certify that it meets Lladró’s high self-imposed standards. Excellence is also applied to the packaging, which is customised to the particularities of each piece, so that it reaches its final destination safely and in PERFECT condition. A GIFT THAT WILL LAST A LIFETIME: The finest details come in the form of porcelain. Gifting a LLADRÓ artwork is synonymous with celebration and joy. It’s a way of saying: I love you, I am happy for your success or welcome. We have the perfect piece for every SPECIAL OCCASION, thanks to a wide range of artistic creations that your loved ones will value and treasure forever. LLADRÓ: Founded in 1953, Lladró is the result of three brothers’ passion for PORCELAIN; Juan, José and Vicente Lladró. Over the years, the expressive possibilities of porcelain have been pushed to the limit, reaching its own unique and distinctive style, which has given the company international fame.', './assets/uploads/images/582.jpg', true, 'active', false);
