INSERT INTO public.products VALUES (747, 'Men Moissanite Ring', 98.00, '2025-04-25 07:27:16.129454', 'This men''s moissanite ring features a stunning 2-carat D color VVS1 moissanite center stone certified by GRA, ensuring authenticity. Its unique design includes a round cut solitaire moissanite surrounded by a five-layer super industry electroplating for durability. The ring also boasts a subtle ergonomic design for comfortable wear, with fine small zircons enhancing its beauty. Crafted from 925 sterling silver with 18K white gold plating, it''s hypoallergenic and safe for sensitive skin. Hand-set moissanite ensures lasting brilliance, making it a perfect choice for an elegant and timeless accessory.', './assets/uploads/images/1308.jpg', true, 'active', false);
INSERT INTO public.products VALUES (748, 'AnuClub Emerald Cut Moissanite Engagement Ring', 114.00, '2025-04-25 07:27:16.129454', 'This item features a stunning lab-created diamond known as moissanite, possessing similar qualities to diamonds including color, hardness, and elemental composition, yet with 2.5 times the brilliance. The D color moissanite is carefully selected for optimal fire and glossiness, with excellent cutting techniques to enhance reflective brilliance, resembling diamonds more closely than other products. The ring showcases a classic emerald cut design with a 2-carat D color solitaire moissanite, featuring eight hearts and arrows for exceptional beauty. Meticulously crafted, it is suitable for any occasion, adding elegance to both casual and formal attire.', './assets/uploads/images/1309.jpg', true, 'active', false);
