INSERT INTO public.products VALUES (760, 'Cat Litter Box Enclosure', 111.56, '2025-04-25 07:27:16.129454', 'This multifunctional cat litter box enclosure serves as both a hidden litter box and versatile furniture piece. Its large headroom offers ample space for storing kitty gear, magazines, or other items. The simple and modern design adds decoration to any room and can also function as a shoe bench for the entryway, capable of holding up to 200 pounds. With a hidden litter box enclosed inside, it provides a private space for your cat, minimizing mess, smell, and litter tracking.', './assets/uploads/images/1321.jpg', true, 'active', false);
