INSERT INTO public.products VALUES (766, 'Flash Furniture Lars 30'''' Round Wood Cocktail Table with 30'''' and 42'''' Columns, Adjustable Wood Bar Height Table for Events or Home Use, Natural', 120.92, '2025-04-25 07:27:16.129454', 'Elevate the seating space at your next event or get together with the Flash Furniture Lars Cocktail Table. This adjustable height table is a must have for DIY and professional decorators hosting events. It also offers an exciting way to enjoy a meal at home if a standard height dining table doesn''t cut it for you. Two 30" and 42" column options allow you to optimize your resources when setting up different events or change the column height to transition from your kitchen to the game room bar. Constructed with a quadruple coated 30" round birchwood tabletop with a heavy-duty black PVC edge, this portable event table adds elegant style to any environment and withstands years of quality use. The sturdy aluminum base features self-leveling floor glides that also make it easy to move the table from room to room or around the venue. Measuring 30"W x 30"D x 30-42"H, this adjustable cocktail table comfortably seats up to 3 adults, making it great for rental businesses, banquet halls, restaurants, or home use.', './assets/uploads/images/1327.jpg', true, 'active', false);
