INSERT INTO public.products VALUES (774, 'SE ELECTRONICS - V7 Myles Kennedy Signature Dynamic Vocal Microphone', 131.79, '2025-04-25 07:27:16.129454', 'INNOVATIVE, SPECIALIZED ALUMINUM VOICE COIL: -The DMC7 X dynamic capsule in the V7 MK has been custom-developed for a crisp, open sound that perfectly captures your voice in the most natural way you''ve ever heard on stage - and its sophisticated supercardioid capsule design helps isolate your voice from other instruments, ensuring vast amounts of gain before feedback. -Proven Neodymium magnets, tight production tolerances & high-end workmanship ensure excellent sensitivity, superior sound quality and superb consistency. PATENTED INTEGRATED SHOCKMOUNT: -The V7 MK’s, patented shockmount efficiently decouples the capsule from mechanical vibration, providing exceptionally low handling noise as compared to other mics in its class. This means you can feel free to move around on stage without fear of rumbles, pops, or anything other than your voice coming through. CUSTOM ROADWORN FINISH: -With this special plating for a unique look and feel, the V7 MK’s roadworn finish makes an immediate impression on stage or in the studio. ALL-METAL HOUSING & BEVELED SPRING STEEL GRILLE: -The V7 MK’s road-ready design is all metal - no plastic parts here. The custom chassis’ high quality, highly durable zinc alloy is designed to hold up under on-stage stress for years, and the spring steel mesh grille is dent-proof and corrosion-free for perfect reliability. Plus, the roadworn finish makes an immediate impression on any stage. -The beveled edge around the grille also prevents your mic from rolling around when you put it down on top of your amp or the stage floor. GOLD-PLATED XLR CONNECTOR: -The V7 MK’s gold-plated XLR connector also ensures a loss-free and reliable signal connection for years to come.', './assets/uploads/images/1335.jpg', true, 'active', false);
