INSERT INTO public.products VALUES (778, 'Biddy Murphy Celtic Warrior Shield Necklace 925 Sterling Silver and 18K Gold Plated Bead, Fine Irish Imported Jewelry', 135.79, '2025-04-25 07:27:16.129454', 'This sterling silver Celtic shield necklace makes the perfect gift for a woman who fights her own battles! Part of Boru’s Celtic Warrior collection, this necklace is inspired by the Ardagh chalice, a ninth century artifact with designs that represent strength and faith. These intricate designs are rendered in sterling silver, and the necklace is embedded with an 18K gold plated bead, creating a radiant shine! The pendant is large, measuring approximately ¾”, a real eye-catcher! The 18” long sterling silver spiga chain is durable and strong and features interwoven links. A great gift for a strong woman in your life, this Celtic necklace comes in a gift box to make giving easy! Made by Boru in Dublin, Ireland. Boru crafts modern jewelry rooted in Ireland’s culture and history. This Boru necklace has been hallmark stamped at the Assay Office in Dublin Castle in Dublin, Ireland, assuring quality of materials and design. The small hallmark stamp often requires a magnifying glass to locate on the back of the pendant. Hallmark features a .925 stamp designating genuine sterling silver, the Boru mark, the Assay Office mark, and a traditional fineness mark. Show someone how much you love and admire them with this stunning sterling silver Celtic shield necklace.', './assets/uploads/images/1339.jpg', true, 'active', false);
