INSERT INTO public.products VALUES (904, 'TAG Heuer Carrera Automatic Blue Dial Men''s Watch', 2750.00, '2025-04-25 07:27:16.129454', 'Introducing the TAG Heuer Carrera Automatic Stainless Steel Blue Dial Day/Date Men''s Watch (Model# WBN2012.BA0640). With classic elegance and precision engineering, this 41mm timepiece features a blue sunray dial, luminescent hands, and day/date display at 3 o''clock. The Swiss automatic movement ensures accuracy, while the stainless steel construction and 100m water resistance guarantee durability. Embodying TAG Heuer''s racing heritage, this watch is a tribute to iconic models like the Autavia and Carrera.', './assets/uploads/images/1466.jpg', true, 'active', false);
