INSERT INTO public.products VALUES (908, 'Shoe Cabinet Shoe Bench Combo with Freestanding Coat Rack', 2260.77, '2025-04-25 07:27:16.129454', 'Introducing our Shoe Bench Combo with Freestanding Coat Rack, crafted from durable walnut wood. Ideal for organizing shoes, boots, and accessories, it''s a versatile addition to any space – from entryways to living rooms. Available in three sizes, each set includes a sturdy shoe bench and a freestanding coat rack. Please note that items other than the shoe rack in the main image are for demonstration only. Due to lighting and display variations, colors may differ slightly from the photo. Additionally, manual measurements may result in slight size discrepancies. Your satisfaction is our priority, so please don''t hesitate to reach out with any concerns. We value your feedback as we strive to improve our products and services.', './assets/uploads/images/1470.jpg', true, 'active', false);
