INSERT INTO public.products VALUES (930, 'Furniture Barn USA Red Cedar Log 42" x 84" Stump Dining Set, Emerson Bark Fabric', 6219.99, '2025-04-25 07:27:16.129454', 'Amish made in the USA Made with traditional mortise and tenon joinery Due to variability in logs, each item will be unique and may vary slightly Log Furniture is subject to the natural process of checking as the wood seasons and dries. Checking occurs as wood releases moisture across or through the annual growth rings; it does not affect the structural performance or the integrity of the wood. This item ships via freight truck. You must have space at your delivery address to accommodate a freight truck in order to receive this delivery.', './assets/uploads/images/585.jpg', true, 'active', false);
