INSERT INTO public.products VALUES (944, 'Electronic Dart Board, Soft Tip Dartboard Set 40 Games, 427 Variants Digital Electric Dart Boards with Colorful LED, 6 Darts, 100 Tips, Power Adapter', 74.99, '2025-04-25 07:27:16.129454', 'COLORFUL LEDS: The dart board features two vibrant LED displays that not only keep track of scores but also display enhanced graphics for cricket games. Compared to regular LCDs, the LEDs are brighter, clearer and visible from a distance, adding extra fun and convenience to playtime. REDUCE BOUNCING: The dart boards for adults are designed with ultra-thin segment dividers and an upgraded scientific target face which reduces bounce-outs greatly. Made of premium PP material and tournament quality thermoplastic surface with a 13.5" target area and a 17" catch ring. VERSATILE DART GAME MODES: Our electronic dartboard offers 40 games and 427 options, from the classic 01 to Cricket and many more. Features 5 levels of computer players and a quick cricket button for one-button starts standard cricket. Support up to 8 players. EASY TO USE: Powered either by 3*AA batteries or an included adapter, comes with a user manual/dart rules and 6 PCS premium aluminum shaft darts with 100 soft tips. The electronic dart board is ready to use and is perfect for the game room, man cave, she shed, etc. HOLIDAY ENTERTAINING: With the bright backlit colorful LED, voice promotion, and lower darts bounce-out rate our dart board electronic scoreboard caters to players of all ages and skill levels. It will improve your game and add a vibrant to your dart-playing moments.', './assets/uploads/images/599.jpg', true, 'active', false);
