INSERT INTO public.products VALUES (1112, 'Zimbabwe - 100 Trillion Dollars Collectible Banknote - Uncirculated', 68.95, '2025-04-25 07:27:16.129454', 'This unique banknote from Zimbabwe makes a fascinating collectible. Issued in 2008 during a time of hyperinflation, it bears the enormous denomination of 100 trillion dollars. Still in uncirculated condition, the note displays the national bird of Zimbabwe, along with intricate security features to confirm its authenticity. Individually packaged in a clear sleeve and rigid mailer, it has been carefully preserved for collection or display. A quirky reminder of an economic crisis, this certified gem of a note would be a conversation starter in any numismatist''s collection. Examine the fine details of the note through the clear packaging to appreciate its near-pristine quality and historic significance from a remarkable period in Zimbabwe''s history.', './assets/uploads/images/845.jpg', true, 'active', false);
