INSERT INTO public.products VALUES (1134, 'Michael Jordan & Serena Williams Autographed Red & Black Nike Court Flare Air Jordan1 Shoes - Upper Deck - Tennis Autographed Miscellaneous Items', 29999.99, '2025-04-25 07:27:16.129454', 'Serena Williams shares many things in common with Michael Jordan, the chief of which is their unending pursuit to be a champion. So when Williams captured her 23rd career Grand Slam singles title at the 2017 Australian Open, it was MJ who surprised Serena with a custom edition of the Nike Court Air Jordans. Serena actually wore the red and black ones at the trophy ceremony following her victory. These shoes made specifically to honor the shared legendary status symbolizing Jordan''s famous jersey number and Williams'' win that tied the all-time mark held by Margaret Court. Friends in life and in legacy, both legends have autographed this pair of shoes for a truly unique memorabilia item. Jordan and Williams have autographed these limited edition (23) red and black Nike Court Flare Air Jordan1 shoes in silver paint pen. Their signatures are on the right shoe and are deemed authentic by virtue of Upper Deck Authenticated''s Five-Step Process. If a product is unsigned or non game-used, a hologram will not be included Michael Jordan memorabilia. memorabilia', './assets/uploads/images/867.jpg', true, 'active', false);
