INSERT INTO public.products VALUES (1233, 'Cole Haan Men''s Grand Crosscourt Sneaker', 64.80, '2025-04-25 07:27:16.129454', 'ith nearly 80 years in the business and hundreds of points of distribution in the U.S., Cole Haan is one of America''s premier luxury brands. Founded in 1928 as a collaboration between Trafton Cole and Eddie Haan, Cole Haan epitomized artisan quality and impeccable craftsmanship during a time when style was everything. Originally, Cole Haan was a men''s footwear label that captured the essence of the 20s spirit with beautifully-designed and well-made shoes for the dapper gentleman. Today, Cole Haan brings that heritage to all of its products, including men''s and women''s dress and casual footwear, belts, hosiery, handbags, small leather goods, outerwear and sunglasses.', './assets/uploads/images/978.jpg', true, 'active', false);
