INSERT INTO public.products VALUES (1348, 'KEEN Unisex-Child Verano Open Toe Sandals', 46.68, '2025-04-25 07:27:16.129454', 'The Verano Open Toe Sandal is a girl’s specific open toe sandal designed for seven day a week usage. This girl’s sandal is built with the idea of open play in mind and is great for whatever playtime may bring. Made with durable, dick-dry polyester webbing and featuring a moisture-wicking lining, the Verano Open Toe Sandal is built off KEEN’s traditional wider footwear form. KEEN products are consciously created using PFC-free water repellent (in applicable styles) and leather sourced from Leather Working Group (LWG)-certified tanneries. KEEN makes shoes to make a difference. From the products it makes, to the actions the it takes, KEEN inspires people to live and work monumental every day. As a brand born for life outside, KEEN has a responsibility to protect and conserve the places where all people live, play and work.', './assets/uploads/images/1098.jpg', true, 'active', false);
INSERT INTO public.products VALUES (1349, 'KEEN Kids Newport H2 Closed Toe Water Sandals, Blue Depths/Gargoyle, 5 US Unisex Toddler', 46.71, '2025-04-25 07:27:16.129454', 'These supportive kids’ summer sandals can take anything a child can dish out. An adjustable hook-and-loop strap lets kids put them on themselves, and quick-drying webbing is perfect in and out of the water. Made with durable polyester and featuring a moisture-wicking lining, the Newport H2 closed toe sandals for kids are built off KEEN’s traditional wider footwear form. From weekends away at camp to days of playing with friends, get ready for endless warm weather outside fun! KEEN products are consciously created using P.E.T. recycled plastic bottles (in applicable styles) and leather sourced from Leather Working Group (LWG)-certified tanneries. KEEN makes shoes to make a difference.', './assets/uploads/images/1099.jpg', true, 'active', false);
