INSERT INTO public.products VALUES (1361, 'Sony Alpha a6700 Mirrorless Camera Body Bundle with Shoulder Bag', 1459.99, '2025-04-25 07:27:16.129454', 'The Sony a6700 Mirrorless Camera seamlessly integrates Sony''s Cinema Line advancements, α-series still-image rendering, and AI recognition technology to cater to the needs of ambitious content creators. It features a 26.0MP Exmor R CMOS sensor and BIONZ XR processor, providing 11 fps continuous stills and UHD 4K video oversampled from 6K. Packed with cinematic capabilities like full pixel readout and S-Cinetone, it serves as a versatile tool for creative professionals. AI-driven autofocus and image stabilization contribute to enhanced clarity, while advanced rendering, a variety of color options, and connectivity features make it a comprehensive solution. The durable magnesium alloy body, vari-angle touchscreen, and improved grip ensure both durability and user-friendly operation.', './assets/uploads/images/1115.jpg', true, 'active', false);
