INSERT INTO public.products VALUES (1365, 'Meinl Cymbals Classics Custom Dark Supreme Box Set', 1629.99, '2025-04-25 07:27:16.129454', 'Classics custom cymbals from Meinl are designed to cut above the roar of guitars, doing most of the work for you so you don''t have to play as hard to be heard. Classics Custom cymbals are made of B12 bronze alloy for a warmer fundamental tone that allows them to sit further down in the mix at softer dynamics and jump to life when energy lifts. Made in Germany from 100% renewable energy. A special finishing process leaves This crash with more complex, dark and warm overtones along with an immediate, punchy response. Not only does this model combine a bright attack with an earthy sustain, the finish adds rich texture and a stunning look. Classics custom cymbals are recommended for most styles of music, including metal, rock, pop, Fusion, and studio.', './assets/uploads/images/1119.jpg', true, 'active', false);
INSERT INTO public.products VALUES (1366, '3M DBI/SALA Rollgliss 3327150 Rescue Unit, Includes 2 Carabiner, 4-Feet Anchor Sling and Rope Bag, 150-Feet', 1689.99, '2025-04-25 07:27:16.129454', 'The Rollgliss R550 is a versatile rescue and descent kit designed for heights up to 1,640 feet (500m). It includes a rescue wheel, anchor sling, carabiners, and a carrying bag. With a fully automatic controlled descent device, it can support one user up to 310 pounds (141kg) or two users totaling 620 pounds (282kg). Its 3/8 inch (9.5mm) super static kernmantle rope and bidirectional connecting hardware ensure safe operations. Used in various industries worldwide, it''s trusted for wind turbine, utility pole, tower construction, emergency rescue, commercial construction, and government/military operations. Every second counts in emergencies, and the Rollgliss R550 offers reliability when it matters most.', './assets/uploads/images/1120.jpg', true, 'active', false);
