INSERT INTO public.products VALUES (1374, 'Miele Complete C3 Marin Canister HEPA Canister Vacuum Cleaner', 1500.99, '2025-04-25 07:27:16.129454', 'Introducing the Miele C3 Series, a pinnacle of design and functionality in floor care. These full-size canisters combine maximum features and efficiency for exceptional cleaning results. Crafted with durable materials like stainless steel and impact-resistant ABS plastic, the C3 series features innovative skeleton construction, making it lighter than previous models. With a 36-foot operating radius and foot pedal controls, cleaning is quick and effective. The C3 also boasts a silence motor and AirClean Sealed System for a quiet environment and cleaner air. The C3 Marin model includes an Electro Comfort electrobrush for carpets and smooth flooring, along with a Parquet Twister for gentle care of smooth surfaces. Its self-adjusting Automatic setting optimizes suction for different floor types, while a telescopic wand and long electrical cord provide a total cleaning radius of 33 feet.', './assets/uploads/images/1128.jpg', true, 'active', false);
