INSERT INTO public.products VALUES (1396, 'JAV Smart Board 75 Interactive Whiteboard 4K Touchscreen', 2296.01, '2025-04-25 07:27:16.129454', 'Magtech Magnetic Photo Pocket Frames offer a convenient way to display your favorite pictures on metal surfaces like refrigerators or lockers. Their durable design includes a flexible magnetic backing and a heavy-duty clear cover, ensuring secure placement without the risk of falling off like acrylic frames. They come in standard sizes including 2.5" x 3.5", 4" x 6", and 5" x 7", allowing easy insertion and changing of pictures using both hands. Note that these magnets won''t adhere to non-ferromagnetic surfaces like copper, brass, aluminum, and some stainless steel.', './assets/uploads/images/1150.jpg', true, 'active', false);
