INSERT INTO public.products VALUES (1398, 'Rinnai i120SN Condensing Gas Boiler', 2363.03, '2025-04-25 07:27:16.129454', 'The Rinnai Condensing Gas Boiler is a compact and efficient heating solution for energy-conscious homeowners. Its stainless-steel heat exchanger and modulating wire mesh burner provide superior performance and reliability. Enjoy precise temperature control with multizone capability and connectable thermostats. The boiler features a safety child-lock and user-friendly interface, with easy temperature adjustments thanks to an outdoor reset sensor and simple parameter settings. Its space-saving design and multiple venting options offer flexible installation. With high AFUE and compatibility with natural gas or propane, it ensures optimal energy efficiency for homes, suitable for both existing and new construction projects.', './assets/uploads/images/1152.jpg', true, 'active', false);
