INSERT INTO public.products VALUES (1743, 'electromagnetic Heating Wire Resistant to high TEM 500 ℃ 600℃ 800℃ Mica High Temperature Wire Pure Copper/Nickel Single Core20/18/17/15/13/11/9AWG Flame Retardant Heating Cable 95Meter Roll (Color :', 913.91, '2025-04-25 07:29:13.225282', 'About this item 【Quality material】- The high temp wire is made of nichrome wire, suitable for general use. Heat resistant wire can resist the heat of a kiln, durable and can support up to 1180°C (2150°F). 【Feature】- Nichrome 80 Wire has high resistivity, good surface oxidation resistance, high temperature level, and has high strength at high temperatures, good processability and weldability. 【Widely Used】- Nichrome wire can be widely used in metallurgy, household appliances, machinery manufacturing and other heating components and electrical industry as resistance materials. Advantage: This braided cable uses mica tape as an insulator, and winds glass fiber and high-temperature resistant mica tape around the conductor, giving the cable excellent heat resistance, insulation and good dielectric strength.', './assets/uploads/images/235.jpg', true, 'active', false);
