INSERT INTO public.products VALUES (1877, 'Arlo Pro 5S 2K Spotlight Camera - 3 Pack - Security Cameras Wireless Outdoor, Dual Band Wi-Fi, Color Night Vision, 2-Way Audio, Home Security Cameras, Home Improvement, Black – VMC4360B', 649.99, '2025-04-25 07:29:13.225282', 'Introducing the Arlo Pro 5S 2K security camera, offering cutting-edge clarity and powerful protection. Enjoy easy wire-free installation and smart Wi-Fi connectivity. Capture details with 2K HDR video, 12x zoom, and a wide 160° field of view. Experience color night vision and enhanced low-light video. Stay charged with rechargeable batteries or solar panels. Enhance security with anti-theft mounts and a yard sign. Compatible with the Arlo Home Security system for extended battery life and image verification. Receive smarter notifications and customize activity zones with a free trial of Arlo Secure. Perfect for home surveillance or as a pet or nanny cam.', './assets/uploads/images/378.jpg', true, 'active', false);
