INSERT INTO public.products VALUES (1898, 'SE ELECTRONICS - sE8 Small Diaphragm Condenser Microphone with Mounting and Case, Factory Matched Pair', 545.00, '2025-04-25 07:29:13.225282', 'Gold-sputtered diaphragms ensure maximum reliability Every capsule is handcrafted and individually tuned Ultra-precision electrode design optimized for superb linearity and natural sonics Ultra-thin 3 micron gold-sputtered diaphragm for superior transients Sophisticated acoustic design with precision components Fit for any challenges in the studio or on stage, the sE8 is a brand new high-performance handcrafted small-diaphragm condenser, fresh from the labs at sE Its new hand-made capsule implements a sophisticated backplate design that provides a perfectly balanced sound, so it''s never harsh or aggressive - perfect for sources like high-hats and drum overheads It''s also one of the quietest small-capsule mics on the planet - and with the highest dynamic range and SPL handling in its class, along with attenuation pads and low-cut filters for superb flexibility, the sE8 is ready for any sounds you’re making, whether in the studio environment or demanding on-stage applications Two Switchable Pre-Attenuation Pads The -10 dB and -20 dB pad switches provide extended dynamic range, enabling a wide range of applications and close-mic techniques for brass instruments, snare drums, and more', './assets/uploads/images/404.jpg', true, 'active', false);
