INSERT INTO public.products VALUES (1960, 'Nike Mens Dunk Low CT0856 700 Off-White - University Gold - Size', 1372.00, '2025-04-25 07:29:13.225282', 'The Off-White x Nike Dunk Low “University Gold” is one of three exclusive colorways of Virgil Abloh’s remixing of the classic sneaker. After collaborating on a plethora of archival Nike models, Abloh applies his craft to a personal favorite of his by outfitting the Dunk with a few unique updates. A University Gold leather base covers the toe, mid-panel and ankle collar. Navy leather overlays contrast the bright yellow panels on the forefoot, toe, eyelets, and heel with navy Swoosh branding located on the mid-panel. Traditional blue laces appear where they have always been, though Abloh opts to add a second set of bright orange laces in a staggered fashion throughout the upper. Completing the look of the limited collaboration is a white rubber midsole with a blue outsole.', './assets/uploads/images/468.jpg', true, 'active', false);
