INSERT INTO public.products VALUES (2054, 'RAYMOND WEIL Maestro Men''s Automatic Watch, Moon Phase, Silver Dial, Roman Numerals, Stainless Steel with Rose Gold PVD Plating, Brown Leather Strap, 39.5 mm (Model: 2239-PC5-00659)', 1550.00, '2025-04-25 07:29:13.225282', 'Maestro Moon Phase: Experience the enchantment of the maestro moon phase feature, showcasing a captivating aperture at six o’clock. Combining art and science, this feature represents watchmaking mastery and adds a touch of otherworldly romance Elegant Design: Make a bold statement with this automatic men''s watch featuring a rose gold case and a genuine brown leather strap. The earthy tones beautifully complement the silver dial, while the blue accents of the moon phase aperture create a striking contrast. A striking accessory for any occasion. Timeless Tradition: Embrace the rich heritage of timekeeping with the moon phase function. This ancient method of tracking months provides a timeless orientation of time. Let this watch connect you to historical craftsmanship and add a touch of vintage charm to your style. Precision Engineering: This mechanical watch boasts automatic winding and a moon phase function, showcasing exceptional precision and reliability. With a power reserve of 38 hours and a movement caliber height of 5.4 mm, it exemplifies meticulous watchmaking artistry. Quality and Durability: Crafted with a stainless steel case and rose gold PVD plating, this watch combines style and durability. The snapped case back with sapphire crystal ensures protection, while the sapphire crystal on the dial enhances clarity and scratch resistance. Water-resistant up to 50 meters, perfect for daily wear.', './assets/uploads/images/566.jpg', true, 'active', false);
