INSERT INTO public.products VALUES (2063, 'Lightspeed Delta Zulu™ ANR Aviation Headset - Premium Noise Canceling Bluetooth Headset for Pilots with Built-in Carbon Monoxide Monitoring and Personalized EQ (GA Dual Plugs)', 1210.00, '2025-04-25 07:29:13.225282', 'Superior Quiet: Advanced active noise reduction (ANR) performance over a deep, broad range of low-frequency noise for a more comfortable flying experience. Carbon Monoxide Sensor: Built-in Kanari smart alert technology measures aircraft cabin carbon monoxide levels and provides audible and visual warnings at preset CO thresholds. Integrated App: Lightspeed''s app smoothly integrates key features CO monitoring, personalized EQ settings, and conversation recording. Customized Hearing: By taking a 12-frequency hearing test in the new Lightspeed app, HearingEQity automatically adjusts your Delta Zulu to optimize every ATC call and conversation specifically for your individual hearing profile. Superior Quiet: Advanced active noise reduction (ANR) performance over a deep, broad range of low-frequency noise for a more comfortable flying experience). Connect to More: Connect directly to other devices for charging, audio, and data transmission via UAC, USB-A, USB-C, 3.5 mm, Lightning plugs, or Bluetooth. Durability & Longevity: Made almost entirely of stainless steel and magnesium with durable cables built around a Kevlar core, the Lightspeed Delta Zulu is designed to endure the harshest flying environments and last for years to come. Industry-Leading 7-Year Manufacturer''s Warranty: Lightspeed stands by the quality of the Lightspeed Delta Zulu with a comprehensive 7-year warranty of materials and workmanship.', './assets/uploads/images/575.jpg', true, 'active', false);
