INSERT INTO public.products VALUES (2084, 'Columbia Men''s Plateau Waterproof Hiking Shoe', 76.90, '2025-04-25 07:29:13.225282', 'These lightweight, waterproof sneakers are a great choice for any activity, in any weather. They feature breathable textile and synthetic overlay construction that offers exceptional support, and all-day comfort. Designed for sure-footed performance these lightweight sneakers are fully waterproof and yet breathable with Omni-Tech materials and construction. Feet will stay dry and comfortable on rainy streets, over gravel paths, or just inside – scuff-free. INSERT INTO public.products VALUES (2085, 'Nike Men''s Sportswear Club Full Zip-Up Hoodie', 83.72, '2025-04-25 07:29:13.225282', 'This Nike zip-up hoodie combines warm coverage with street style, offering plush comfort without bulk. It features a full-length zipper for easy wear. Crafted with soft fleece fabric, this men''s hoodie has an updated, slim hem and cuffs for a clean appearance. The fleece lining is brushed on the back for added softness. It''s machine washable, imported, and the body fabric consists of 80-82% cotton and 18-20% polyester (material percentages may vary by factory, check label for details), with the hood fabric made entirely of cotton. The Nike logo is embroidered on the left chest, adding a touch of brand detail.', './assets/uploads/images/1312.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2086, 'URBAN ARMOR GEAR UAG Case Compatible with iPhone 15 Pro Case 6.1" Monarch Pro Kevlar Black Built-in Magnet Compatible with MagSafe Charging Premium Rugged Military Grade Dropproof Protective Cover', 102.00, '2025-04-25 07:29:13.225282', 'The Monarch Pro Kevlar - the ultimate all-terrain, rugged protective case is MagSafe compatible, featuring a powerful built-in magnet module for seamless charging compatibility. Engineered with premium materials for unrivaled protection, this case is designed to take on any adventure. The Monarch Pro boasts an impressive 5-layer construction, including a shock-resistant core, a distinctive signature armor frame layered with DuPont Kevlar Material, a polycarbonate shear plate, alloy metal hardware, and an impact-resistant rubber surround. This case offers both advanced protection and effortless functionality.', './assets/uploads/images/1313.jpg', true, 'active', false);
