INSERT INTO public.products VALUES (2090, 'AliveRose Real Rose Gold Dipped Necklace', 75.20, '2025-04-25 07:29:13.225282', 'This pendant necklace features a stunning real rose, hand-picked and preserved forever by being dipped in 24K gold. The meticulous process involves 5 days of handwork and 65 steps, resulting in a breathtaking jewel that captures attention wherever you go. Both the chain and pendant are plated with 24K gold, ensuring lasting beauty and elegance. Each rose is carefully selected for its clear veins and natural color, then matched with 24K gold using modern technology. With exquisite craftsmanship and attention to detail, this necklace is suitable for every woman, offering a timeless and luxurious accessory.', './assets/uploads/images/1317.jpg', true, 'active', false);
