INSERT INTO public.products VALUES (2092, 'DINZI LVJ Shoe Storage Bench with Cushion, 16-Cubby Shoe Rack', 106.00, '2025-04-25 07:29:13.225282', 'This entryway storage solution offers organization and versatility. With 16 cubbies, it accommodates 10-16 pairs of shoes, each with ample space for men''s shoes. The fixed middle compartments are ideal for sneakers and heels, while the adjustable side compartments suit slippers, tall boots, or storage boxes. Beyond shoe storage, it doubles as a bench for various spaces like entryways, living rooms, or bedrooms, providing convenient storage for blankets, books, or toys.', './assets/uploads/images/1319.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2093, '4 Piece Patio Outdoor Furniture Set with Strong Powder Coated Metal Frame One Love Seat', 112.49, '2025-04-25 07:29:13.225282', 'This patio chair features high-quality Textilene material for the backrest and seat, ensuring breathability and comfort, even in hot weather. Its easy-to-clean design allows for simple maintenance with just a damp or dry cloth. The curved back design facilitates easy lifting and prevents floor scratches, making furniture rearrangement hassle-free. With a sturdy and durable powder-coated steel pipe frame, this patio furniture set is built to last, resisting deformation and erosion from rainwater for a long service life.', './assets/uploads/images/1320.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2094, 'Cat Litter Box Enclosure', 111.56, '2025-04-25 07:29:13.225282', 'This multifunctional cat litter box enclosure serves as both a hidden litter box and versatile furniture piece. Its large headroom offers ample space for storing kitty gear, magazines, or other items. The simple and modern design adds decoration to any room and can also function as a shoe bench for the entryway, capable of holding up to 200 pounds. With a hidden litter box enclosed inside, it provides a private space for your cat, minimizing mess, smell, and litter tracking.', './assets/uploads/images/1321.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2095, 'KingTool 325 Piece Home Repair Tool Kit, General Home/Auto Repair Tool Set', 107.20, '2025-04-25 07:29:13.225282', 'This toolbox set includes a 1-drawer storage box with a sliding drawer for enhanced capacity. It contains a variety of essential tools in a durable plastic case with molded compartments for protection and easy access. Crafted from high-quality steel with a heat-treated chrome finish, the tools are resistant to corrosion and built to last. The handles are made of TPR material for a comfortable grip. With 325 pieces, this versatile tool set is suitable for small repairs and DIY projects around the house, making it ideal for handymen, construction workers, mechanics, and workshops. It also serves as a thoughtful gift for family, friends, or partners.', './assets/uploads/images/1322.jpg', true, 'active', false);
