INSERT INTO public.products VALUES (2106, 'HOMES: Inside + Out Payne Modern Half Moon Accent Console Table with Storage Shelf, Decorative Entryway Furniture for Living Room, Hallway, Entrance, Small Spaces, Sage Green', 127.19, '2025-04-25 07:29:13.225282', 'The Epitome of Craftsmanship & Quality Step up your interior game with our half-moon small console table. Seamlessly blending into any modern setting, its unique design is sure to captivate. Composed of high-quality engineered wood, this table stands testament to durability and sturdiness. Its meticulously beveled edges echo sophistication while ensuring safety. And for a touch of panache? Note the subtly tapered legs, adding to its inherent elegance. As a bonus, the storage shelf offers ample space, eager to showcase your personal artifacts.  Functionality, Setup & Positioning The beauty of our table lies in its adaptability. Envision it gracing your foyer or perhaps as an accent in your living room; its utility is boundless. Designed with the modern American homeowner in mind, it effortlessly complements an array of interior styles. Envisage it as a sofa table with storage or an expressive hallway table for entryway trinkets. And the best part? Setting it up is child''s play, thanks to the user-friendly manual included, guaranteeing a hassle-free experience.  Why Choose This Console Table? Beyond its design and function, it''s about creating spaces that feel like home. Spaces where you walk in, drop your keys, and feel that sigh of relief. With this small console table for small spaces, you''re not just buying furniture; you''re investing in warmth, style, and comfort. Its narrow design ensures it fits perfectly, even in tight spots, making it an essential for modern living. Imagine displaying your cherished family photos, or that antique vase you picked up from your travels. Every detail, every design choice, makes it a piece that''s uniquely yours.', './assets/uploads/images/1333.jpg', true, 'active', false)