INSERT INTO public.products VALUES (2107, 'Reebok Men''s Floatzig 1 Sneaker', 128.95, '2025-04-25 07:29:13.225282', 'Whether you’re moving your body or moving ideas forward, aim to move in the direction of progress. Day after day, find time to lace up your gym shoes and get in your workout, wherever, whenever and whatever it might be. There’s no one way approach fitness as long as you’re living an active life. If you’re passionate about running, weightlifting, cross training or studio workouts, Reebok has a range of athletic shoes designed to support you with technology and comfort. And no matter how you move, do it with purpose and style. Reebok’s retro sneakers were born from sports out of the 80s and 90s. Then, they were gamechangers on the basketball and tennis courts, track and trails. Now, they’re timelessly', './assets/uploads/images/1334.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2116, 'Garmin 010-02626-10 Instinct 2, Rugged Outdoor Watch with GPS, Built for All Elements, Multi-GNSS Support, Tracback Routing and More, graphite', 198.85, '2025-04-25 07:29:13.225282', 'Whatever you do, own it with Instinct® 2. This rugged GPS smartwatch is tough enough to keep up with you and unique enough to fit your style. Do more of what you love with preloaded activity profiles for running, biking, swimming and more. Live the ultimate connected life with smart notifications and Connect IQ™ compatibility when paired with your compatible smartphone. Understand your body better with all-day health monitoring for energy levels, stress, sleep, Pulse Ox and much more (Pulse Ox not available in all countries. This device is intended to give an estimation of your activity and metrics; it is not a medical device).', './assets/uploads/images/1343.jpg', true, 'active', false);
