INSERT INTO public.products VALUES (2108, 'SE ELECTRONICS - V7 Myles Kennedy Signature Dynamic Vocal Microphone', 131.79, '2025-04-25 07:29:13.225282', 'INNOVATIVE, SPECIALIZED ALUMINUM VOICE COIL: -The DMC7 X dynamic capsule in the V7 MK has been custom-developed for a crisp, open sound that perfectly captures your voice in the most natural way you''ve ever heard on stage - and its sophisticated supercardioid capsule design helps isolate your voice from other instruments, ensuring vast amounts of gain before feedback. -Proven Neodymium magnets, tight production tolerances & high-end workmanship ensure excellent sensitivity, superior sound quality and superb consistency. PATENTED INTEGRATED SHOCKMOUNT: -The V7 MK’s, patented shockmount efficiently decouples the capsule from mechanical vibration, providing exceptionally low handling noise as compared to other mics in its class. This means you can feel free to move around on stage without fear of rumbles, pops, or anything other than your voice coming through. CUSTOM ROADWORN FINISH: -With this special plating for a unique look and feel, the V7 MK’s roadworn finish makes an immediate impression on stage or in the studio. ALL-METAL HOUSING & BEVELED SPRING STEEL GRILLE: -The V7 MK’s road-ready design is all metal - no plastic parts here. The custom chassis’ high quality, highly durable zinc alloy is designed to hold up under on-stage stress for years, and the spring steel mesh grille is dent-proof and corrosion-free for perfect reliability. Plus, the roadworn finish makes an immediate impression on any stage. -The beveled edge around the grille also prevents your mic from rolling around when you put it down on top of your amp or the stage floor. GOLD-PLATED XLR CONNECTOR: -The V7 MK’s gold-plated XLR connector also ensures a loss-free and reliable signal connection for years to come.', './assets/uploads/images/1335.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2109, 'Depisuta Electric Slicer Shredder, 5In1 Electric Vegetable Cutter Food Slicer Cheese Grater, One Touch Control Electric Salad Shooter, 250W Electric Cheese Shredder for Carrot, Vegetable', 132.26, '2025-04-25 07:29:13.225282', 'vegetables and other food you want. 2. Multi Functional Design: This kitchen grater not only slices and shreds but also cuts, making it perfect for daily cooking needs and large gatherings, it makes you feel more convenient when you use it. 3. 5pcs Stainless Steel Blades: Equipped with 5 stainless steel blades for various cutting options such as thin slices, thick slices, strips, and coarse chopping, providing high efficiency and flexibility. 4. One Touch Control: With simple one touch operation, cooking becomes more efficient, which is allowing you to say goodbye to traditional kitchen tasks, providing great convenient for you. 5. Salad Maker Function: In addition to slicing and shredding, electronic shredder can also function as an electric salad maker, effortlessly shredding fruits and vegetables for healthy meals.', './assets/uploads/images/1336.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2110, 'WBXDIHA Reusable Hot Water Bag Thick Portable Keep Warm Girls Hand Warmer Body Belly Household Items(Color:E)', 133.76, '2025-04-25 07:29:13.225282', 'This hot water bottle is made of food grade silicone，and is friendly and non-toxics,BPA free. And it is silky, easy to clean and extremely . This silicone hot water bag is equipped with a knit cover to prevent your skin from directly contacting the hot surface and causing burns. This BPA free hot water bottle is a beautifully crafted, easy to carry hot water bottle. It warms your hands and feet in the cold, and relieves the pain in your stomach during the menstrual period. It can be used when going out to work, play, exercise, travel, or in the office. Wall thickness upgrade, thickness is about 0.87 inches, longer holding time. Cold therapy can be used to make a cold compress during a fever, and to properly relieve swelling symptoms during an injury. Can be used as a Christmas gift, birthday gift, Valentine''s Day gift, gift exchange party gift, very suitable for family and friends.', './assets/uploads/images/1337.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2111, 'Storm Collectibles Samurai Shodown Genjuro Kibagami 1/12 Scale Action Figure', 134.95, '2025-04-25 07:29:13.225282', 'GENJURO KIBAGAMI - This swordsman from Samurai Shodown series regards Haohmaru as his sworn enemy. Like Haohmaru, Genjuro trained with Nikochin Kaffein long ago, but he was admonished for his belief that "the sword is a means to kill" and cast out. His swordplay is forceful and so fierce that he''s feared to be a "loose blade."', './assets/uploads/images/1338.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2112, 'Biddy Murphy Celtic Warrior Shield Necklace 925 Sterling Silver and 18K Gold Plated Bead, Fine Irish Imported Jewelry', 135.79, '2025-04-25 07:29:13.225282', 'This sterling silver Celtic shield necklace makes the perfect gift for a woman who fights her own battles! Part of Boru’s Celtic Warrior collection, this necklace is inspired by the Ardagh chalice, a ninth century artifact with designs that represent strength and faith. These intricate designs are rendered in sterling silver, and the necklace is embedded with an 18K gold plated bead, creating a radiant shine! The pendant is large, measuring approximately ¾”, a real eye-catcher! The 18” long sterling silver spiga chain is durable and strong and features interwoven links. A great gift for a strong woman in your life, this Celtic necklace comes in a gift box to make giving easy! Made by Boru in Dublin, Ireland. Boru crafts modern jewelry rooted in Ireland’s culture and history. This Boru necklace has been hallmark stamped at the Assay Office in Dublin Castle in Dublin, Ireland, assuring quality of materials and design. The small hallmark stamp often requires a magnifying glass to locate on the back of the pendant. Hallmark features a .925 stamp designating genuine sterling silver, the Boru mark, the Assay Office mark, and a traditional fineness mark. Show someone how much you love and admire them with this stunning sterling silver Celtic shield necklace.', './assets/uploads/images/1339.jpg', true, 'active', false);
