INSERT INTO public.products VALUES (2138, 'Drive Medical Lightweight Folding Transport Wheelchair With Carry Bag & Flip-Backs Arms', 226.00, '2025-04-25 07:29:13.225282', 'Drive Medical''s portable lightweight transport chairs feature convenient design elements like padded flip-back armrests and an included carry bag for easy storage and transportation. Our ultra-lightweight wheelchair features a lightweight silver aluminum wheel chair frame and maintenance-free composite wheels with rear wheel locks. Weighing only 19 pounds, this transport chair is one of the lightest in the market. It folds like a conventional folding chair and comes standard with fold-down footrests for added convenience and comfort. Backed by a limited lifetime warranty from Drive Medical, a leading brand of mobility aids and other medical goods for more than 20 years, you can purchase with confidence.', './assets/uploads/images/1365.jpg', true, 'active', false);
