INSERT INTO public.products VALUES (2245, 'Panasonic Lumix DC-GH5s Mirrorless Digital Camera Bundle Lumix G Leica 12-60mm F/2.8-4.0 Lens, Atomos Ninja V 5-inch Touchscreen Monitor and Accessories', 2840.05, '2025-04-25 07:29:13.225282', 'Step up to the professional grade Panasonic LUMIX GH5S C4K mirrorless camera that offers over 29 LUMIX and LEICA compact lens options built on the next-generation (ILC) interchangeable lens camera standard [Micro Four Thirds] pioneered by Panasonic. Its "mirrorless" design enables the high performance, durability, mobility, and low light gathering needed for professional Cinematic and Anamorphic 4K video production. The LUMIX GH5s includes cutting-edge C4K: 60p50p 4:2:0 8-bit, 30p25p/24p 4:2:2 10-bit, 4K: 60p50p 4:2:0 8-bit, 30p/25p/24p 4:2:2 10-bit recording* with unlimited recording. The GH5s comes pre-installed with HDR Hybrid Log Gamma and Panasonic''s V-LogL along with professional grade exposure tools like: Time Code sync, Waveform, Vector Scopes, and programmable Zebra patters. The LUMIX GH5s supports important recording features like 14bit RAW for stills, dual native IS0, Panasonic XLR mic Adaptor support, and the return of multi-aspect capture.', './assets/uploads/images/1473.jpg', true, 'active', false);
