INSERT INTO public.products VALUES (2267, 'Free Fly Women''s Lined Breeze Short - Moisture-Wicking Active Shorts with Sun Protection UPF 50+ and Bamboo Viscose Liner', 68.00, '2025-04-25 07:29:13.225282', 'ULTRA BREATHABLE AND LIGHTWEIGHT: For unparalleled comfort, breathability, quick dry, moisture-wicking, plus sun protection, our multi-purpose Breeze fabric has it all. Feels great and performs even better, the Women’s Breeze Short keeps you on the go for whatever the day throws at you. PERFORMANCE-LEVEL COMFORT: Light, airy, and packed with stretch, our Breeze fabric is built to perform and endure in the outdoors. The quick-dry construction means they play nice on the water while the stretch-infused fabric makes them perfect for any active pursuit. SIZE & FIT: The Women’s Lined Breeze Short is designed with a body-hugging fit and a 4 inch inseam. A stretchy elastic waistband soft bamboo viscose liner allows superior comfort for all of your outdoor adventures. CARE & MAINTENANCE: To extend the life and preserve the quality of your Lined Breeze Shorts, it''s important to maintain them properly. We recommend washing them inside out on a delicate cycle with cold water. For optimal results, hang to dry. ABOUT FREE FLY: We’re a family-owned apparel company that stands for comfort and freedom. We believe that life’s best moments are spent outside doing the things you love, so we made it our mission to empower your most comfortable life outdoors.', './assets/uploads/images/588.jpg', true, 'active', false);
