INSERT INTO public.products VALUES (2280, 'ecobee Smart Sensor 2 Pack - Comfort, Security, Energy Savings - Smart Home - Compatible with ecobee Smart Thermostats for Home', 96.65, '2025-04-25 07:29:13.225282', 'Knows when a room is occupied and communicates the temperature to your ecobee smart thermostat from up to a range of 60 ft, through walls and floors. This prompts your thermostat to make temperature adjustments ensuring comfort. Place SmartSensor in your bedroom and say goodbye to those moments that are either too hot or too cold throughout the night. Understands your household comings and goings, saving energy and saving you money by not heating or cooling an empty home. You’ll be able to see the temperature difference and occupancy in particular parts of your home and adjust right from the ecobee app for maximum comfort. Installation is quick and easy. Place your SmartSensor, magnetically and wirelessly, at least 5ft above the floor on its satin-steel stand or on any wall using the self-adhesive wall mounting brackets It can detect unexpected motion. When Smart Security is armed, you get real-time alerts on the ecobee app, so you know what’s happening at home when you’re not there. *Requires ecobee Smart Security subscription.', './assets/uploads/images/601.jpg', true, 'active', false);
