INSERT INTO public.products VALUES (2282, 'X-Sense Smart Smoke Detectors with SBS50 Base Station, Wi-Fi Smoke Alarm Compatible with X-Sense Home Security App, Wireless Interconnected Mini Fire Alarm, Model FS51', 97.49, '2025-04-25 07:29:13.225282', 'Never Miss an Alarm: Whenever smoke is detected, you’ll get an immediate alert on your phone; at the same time, the base station and each linked alarm will sound loudly, letting everyone at home know to evacuate Build a Smart Home Safety System: The SBS50 base station supports up to 50 devices including the XS01-M smoke alarm, XC01-M carbon monoxide alarm, XP0A-MR combination alarm, STH51 thermo-hygrometer, SWS51 water leak sensor and more; the 1,640 ft (500 m) open-air connection range means you can even secure every corner Instant Status Alerts: Monitor your home from anywhere and receive instant notifications for alarms, low battery warnings, faults, and more via the X-Sense Home Security app; you''ll also get a notification when the danger has passed Control with One Button: Easily connect the base station to your Wi-Fi with one button, and quickly silence your entire system by tapping the silence button in the app or on the base station Test from the App: Enjoy instant and easy peace of mind by testing the alarm from within the app, without having to climb a ladder to press a button on the device itself Fast Fire Dispatch Within Just 3 Seconds: As a subscriber to the Protect+ Premium which provides 24/7 professional monitoring service, when an alarm is triggered, you will receive a message from the monitoring center within 3 seconds to verify the emergency. After the emergency is verified, a fire truck will be dispatched immediately Share the Convenience: The handy Family Sharing feature allows up to 12 family members to control the device using the X-Sense app – receive push notifications, test/silence devices, check the alarm status and more Full Kit Provided: 1 SBS50 base station, 5 XS01-M smoke alarms, 1 power adapter, and 1 power cable included; simply download the X-Sense Home Security app and add the devices via a 2.4 GHz Wi-Fi network (incompatible with 5 GHz) to start protecting your home the smart way', './assets/uploads/images/604.jpg', true, 'active', false);
