INSERT INTO public.products VALUES (2567, 'Cole Haan Men''s Grand Crosscourt Sneaker', 64.80, '2025-04-25 07:29:13.225282', 'ith nearly 80 years in the business and hundreds of points of distribution in the U.S., Cole Haan is one of America''s premier luxury brands. Founded in 1928 as a collaboration between Trafton Cole and Eddie Haan, Cole Haan epitomized artisan quality and impeccable craftsmanship during a time when style was everything. Originally, Cole Haan was a men''s footwear label that captured the essence of the 20s spirit with beautifully-designed and well-made shoes for the dapper gentleman. Today, Cole Haan brings that heritage to all of its products, including men''s and women''s dress and casual footwear, belts, hosiery, handbags, small leather goods, outerwear and sunglasses.', './assets/uploads/images/978.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2568, 'Skechers Men''s Go Max-Athletic Air Mesh Slip on Walking Shoe Sneaker', 62.40, '2025-04-25 07:29:13.225282', 'Get the maximum comfort and cushioning for athletic walking with the Skechers go walk max. Mesh fabric upper with cushioned, supportive sole design. Designed with Skechers performance technology and materials specifically for athletic walking. Goga max technology insole with high-rebound cushioning. The company''s success stems from it''s high quality, diversified, and affordable product line that meets consumers'' Various lifestyle needs. Since it''s inception in 1992, the Skechers diverse product offering has grown from utility style boots to include seven Skechers brands and five uniquely branded fashion lines for men and women. Skechers is an award-winning global leader in lifestyle footwear offering shoes that appeal to trend-savvy men, women and kids everywhere. The brand''s styles include the latest innovative athletic, casual and fashion sneakers as well as sandals and boots—with many collections featuring Skechers air-cooled memory foam insoles for added comfort. Plus, Skechers offers a range of slip-resistant work FOOTWEAR for men and women, as well as cool, fun, playful and lighted styles that boys and girls love. Always ahead of the fashion curve, Skechers has made its sport, casual and dress casual shoes essential to every closet.', './assets/uploads/images/979.jpg', true, 'active', false);
