INSERT INTO public.products VALUES (2584, 'Mr. Heater F242010 MH4GC Golf Cart Heater,Silver and Black', 64.99, '2025-04-25 07:29:13.225282', 'This patented 4,000 BTU liquid propane heater connects directly to a 1 lb. LP cylinder and is the perfect solution for heating in a golf cart. The unit features a wind resistant burner and pilot system for optimal heat output in windy conditions and when the golf cart is moving. It also features a unique safety tip over switch that minimizes nuisance shut-offs when driving on bumpy cart paths. The integrated handle and cup holder adapter make this unit easy to transport and compatible with most golf cart cup holders. To light the unit push then hold the ignition button and the integrated Piezo sparking mechanism will take care of the rest. With the oxygen depletion sensor (ODS) you can be sure that you will enjoy years of comfortable safe heat. One button push ignition/on function. 4,000 BTU wind resistant burner and pilot system. Cup holder adapter. Automatic low oxygen shut-off system. Connects directly to a 1lb. disposable cylinder 90 degree tip-over safety shut-off system.', './assets/uploads/images/995.jpg', true, 'active', false);
