INSERT INTO public.products VALUES (2679, 'SUNKTA Smart Watch', 49.99, '2025-04-25 07:29:13.225282', 'Men''s voice chat smartwatch: This Bluetooth phone calls smartwatch for men to make and receive calls has a built-in microphone and speaker, allowing you to make and receive calls directly from your watch and no longer rely on your phone.This compatible with Android and iPhone smartwatch also comes with an AI voice assistant function.Whether you''re playing sports outdoors, travelling or driving, you can maintain uninterrupted communication and enjoy freedom anytime, anywhere.', './assets/uploads/images/1094.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2680, 'ASICS Kid''s Contend 8 Grade School Running Shoes', 49.95, '2025-04-25 07:29:13.225282', 'The CONTEND 8 GRADE SCHOOL shoe is designed for young feet. Details like the toecap, toe rubber stitching, and solid rubber outsole increase durability and lengthen the shoe''s lifespan.', './assets/uploads/images/1095.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2681, 'Boys Girls Kids'' Sneakers Knitted Mesh Sports Shoes', 49.99, '2025-04-25 07:29:13.225282', 'kids shoes combine fashion with sports, and are committed to creating shoes that better meet children''s preferences.The functionality of our kids sports shoes is diverse: comfortable, breathable,lightweight and flexibility to provide a good wearing experience for children. The anti-slip and shock absorption design offer safe protect for kids. The kids sneakers suitable for any occasions,such as walking,running, jogging, dancing, tennis and other indoor or outdoor activities.', './assets/uploads/images/1096.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2682, 'KEEN Unisex-Child Verano Open Toe Sandals', 46.68, '2025-04-25 07:29:13.225282', 'The Verano Open Toe Sandal is a girl’s specific open toe sandal designed for seven day a week usage. This girl’s sandal is built with the idea of open play in mind and is great for whatever playtime may bring. Made with durable, dick-dry polyester webbing and featuring a moisture-wicking lining, the Verano Open Toe Sandal is built off KEEN’s traditional wider footwear form. KEEN products are consciously created using PFC-free water repellent (in applicable styles) and leather sourced from Leather Working Group (LWG)-certified tanneries. KEEN makes shoes to make a difference. From the products it makes, to the actions the it takes, KEEN inspires people to live and work monumental every day. As a brand born for life outside, KEEN has a responsibility to protect and conserve the places where all people live, play and work.', './assets/uploads/images/1098.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2683, 'KEEN Kids Newport H2 Closed Toe Water Sandals, Blue Depths/Gargoyle, 5 US Unisex Toddler', 46.71, '2025-04-25 07:29:13.225282', 'These supportive kids’ summer sandals can take anything a child can dish out. An adjustable hook-and-loop strap lets kids put them on themselves, and quick-drying webbing is perfect in and out of the water. Made with durable polyester and featuring a moisture-wicking lining, the Newport H2 closed toe sandals for kids are built off KEEN’s traditional wider footwear form. From weekends away at camp to days of playing with friends, get ready for endless warm weather outside fun! KEEN products are consciously created using P.E.T. recycled plastic bottles (in applicable styles) and leather sourced from Leather Working Group (LWG)-certified tanneries. KEEN makes shoes to make a difference.', './assets/uploads/images/1099.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2684, 'SMITH Optics Frontier Unisex Snow Winter Goggles', 42.00, '2025-04-25 07:29:13.225282', 'Any weather. Any day. The Smith Frontier goggles enhance your view of the whole mountain. Our Airflow lens technology maintains active ventilation through the best and worst conditions for fog-free visibility. Their modern frame and medium fit combine with a low-profile design for a wide range of faces, and they have full helmet compatibility.', './assets/uploads/images/1100.jpg', true, 'active', false);
