INSERT INTO public.products VALUES (2687, 'Lifestride womens Giovanna 2', 44.99, '2025-04-25 07:29:13.225282', 'Add a stylish touch to any look in this easy-to-wear wedge sandal with an asymmetrical strap. Faux leather, fabric, or canvas upper with an open toe, slip-on fit, asymmetrical strap detail, and wrapped wedge.', './assets/uploads/images/1103.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2688, 'MCIKCC Kids Waterproof Rain Boots,High Snow Boots for Toddler Boys Girls,Textile Rubber Sole', 49.99, '2025-04-25 07:29:13.225282', 'The boots are tailored for rainy and snowy days. 100% Waterproof. The combination of the textile and rubber surface is beautiful and comfortable. A grippy sole and easy-on pull belts. MCIKCC shoes are beautifully made of natural rubber and imported fabrics. It''s waterproof and cold proof, so it keeps your feet dry all day long. Whether you''re playing in the park or dealing with pet poop outdoors, it still can keep your feet comfortable. Let you and your children enjoy life to the fullest.', './assets/uploads/images/1104.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2690, 'TUMI - Alpha Tall 4-Wheel Duffel Packing Suitcase - Features Zip Divider and Large Mesh Zip Pocket - Rolling Luggage for Men and Women - Black', 1495.00, '2025-04-25 07:29:13.225282', 'The TUMI Alpha Tall 4 Wheeled Duffel Packing Case Suitcase brings together the ease of a duffel and the clever functionality of the wheeled cases we''re known for. With a quick zip of the interior, the roomy main compartment can be divided into two sections to help organize, for example, clean and dirty items. Five dividers in the back compartment are perfect for shoes, and additional pockets inside and out ensure that your smaller essentials stay organized and easy to reach.', './assets/uploads/images/1110.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2691, 'TUMI - Alpha Worldwide Trip Expandable 4-Wheeled Packing Case - Large Suitcase with Top and Side-Grab Handles - Black', 1495.00, '2025-04-25 07:29:13.225282', 'Great for extended trips, our biggest suitcase features an extra-large compartment that can be expanded up to 2" (5 cm). Your dresses, coats, suits, shoes, and other belongings stay secure thanks to double-coil security zippers for the main opening and U-zip pocket. Multiple interior zip pockets keep smaller essentials organized. Made of ballistic nylon and with durable handles, this roomy suitcase provides extra comfort while packing and helps with easy handling on your travels.', './assets/uploads/images/1111.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2692, 'Prada Unisex Medium Black Tessuto Nylon Messenger Crossbody Handbag', 1795.00, '2025-04-25 07:29:13.225282', 'This black Prada Tessuto nylon messenger cross body handbag is so sleek and classically Prada. The black Prada logo looks beautiful with the black nylon and goes great with most everyday looks. The nylon is durable and there are two interior pockets long with one exterior pocket.', './assets/uploads/images/1112.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2693, 'Prada Womens Beige Vitello Move Leather Chain Wallet', 1790.00, '2025-04-25 07:29:13.225282', 'Elevate your look with this Prada Vitello Move chain wallet! This piece is crafted from Cipria beige calfskin leather, featuring the iconic gold Prada logo on the front face. The flap opens to a leather interior containing a zipper pocket, three bill slots, and six card slots. Wear this bag as a crossbody or remove the strap for an elegant clutch.', './assets/uploads/images/1113.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2694, 'Sloan WES-150 WaterFree Urinal', 1695.68, '2025-04-25 07:29:13.225282', 'UNIVERSAL COMPATIBILITY: The Sloan WES-150 WaterFree Urinal cartridge is designed to be used with all Sloan Waterfree urinals, ensuring compatibility and ease of installation.', './assets/uploads/images/1114.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2695, 'Sony Alpha a6700 Mirrorless Camera Body Bundle with Shoulder Bag', 1459.99, '2025-04-25 07:29:13.225282', 'The Sony a6700 Mirrorless Camera seamlessly integrates Sony''s Cinema Line advancements, α-series still-image rendering, and AI recognition technology to cater to the needs of ambitious content creators. It features a 26.0MP Exmor R CMOS sensor and BIONZ XR processor, providing 11 fps continuous stills and UHD 4K video oversampled from 6K. Packed with cinematic capabilities like full pixel readout and S-Cinetone, it serves as a versatile tool for creative professionals. AI-driven autofocus and image stabilization contribute to enhanced clarity, while advanced rendering, a variety of color options, and connectivity features make it a comprehensive solution. The durable magnesium alloy body, vari-angle touchscreen, and improved grip ensure both durability and user-friendly operation.', './assets/uploads/images/1115.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2696, 'Sony Alpha a7 III Mirrorless Digital Camera with FE 28-70mm Lens - Bundle w/Shoulder Bag, 32GB SD Card, Cleaning Kit, Card Reader, SD Card Case, PC & Mac Software Kit, Extra Battery, 55mm Filter Kit', 1698.00, '2025-04-25 07:29:13.225282', 'Sony Alpha a7 III Mirrorless Digital Camera with FE 28-70mm Lens - Bundle w/Shoulder Bag, 32GB SD Card, Cleaning Kit, Card Reader, SD Card Case, PC & Mac Software Kit, Extra Battery, 55mm Filter Kit', './assets/uploads/images/1116.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2697, 'Sony a7 III Full Frame Mirrorless Interchangeable Lens 4K HDR Camera ILCE-7M3 Body Bundle with Deco Gear Travel Bag, 2X 64GB Memory Cards, Editing Suite and Accessories (18 Items)', 1798.00, '2025-04-25 07:29:13.225282', 'The a7 III has been refined for extraordinary image capture control and quality from the next generation 24.2MP full-frame BSI image sensor and latest BIONZ X image processor, down to the smallest operational detail. Featuring 693 phase AF points with up to 10fps continuous shooting 4K HDR video and the longest battery life of any mirrorless camera to date – the a7 III has everything you need.', './assets/uploads/images/1117.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2698, 'Sony Alpha a7 III Mirrorless Digital Camera - Bundle with Shoulder Bag, 32GB SD Card, Cleaning Kit, Card Reader, SD Card Case, Corel PC Software Kit, Extra Battery', 1498.00, '2025-04-25 07:29:13.225282', 'Experience the versatility of the Sony a7 III, a camera designed to excel in both photography and videography across diverse scenarios. Boasting a cutting-edge 24.2MP Exmor R BSI CMOS sensor and BIONZ X processor, this camera elevates image quality, video capabilities, and autofocus performance. Its refined body design encompasses a new touchscreen LCD, enhanced EVF, extended battery life, and dual memory card slots.', './assets/uploads/images/1118.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2699, 'Meinl Cymbals Classics Custom Dark Supreme Box Set', 1629.99, '2025-04-25 07:29:13.225282', 'Classics custom cymbals from Meinl are designed to cut above the roar of guitars, doing most of the work for you so you don''t have to play as hard to be heard. Classics Custom cymbals are made of B12 bronze alloy for a warmer fundamental tone that allows them to sit further down in the mix at softer dynamics and jump to life when energy lifts. Made in Germany from 100% renewable energy. A special finishing process leaves This crash with more complex, dark and warm overtones along with an immediate, punchy response. Not only does this model combine a bright attack with an earthy sustain, the finish adds rich texture and a stunning look. Classics custom cymbals are recommended for most styles of music, including metal, rock, pop, Fusion, and studio.', './assets/uploads/images/1119.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2700, '3M DBI/SALA Rollgliss 3327150 Rescue Unit, Includes 2 Carabiner, 4-Feet Anchor Sling and Rope Bag, 150-Feet', 1689.99, '2025-04-25 07:29:13.225282', 'The Rollgliss R550 is a versatile rescue and descent kit designed for heights up to 1,640 feet (500m). It includes a rescue wheel, anchor sling, carabiners, and a carrying bag. With a fully automatic controlled descent device, it can support one user up to 310 pounds (141kg) or two users totaling 620 pounds (282kg). Its 3/8 inch (9.5mm) super static kernmantle rope and bidirectional connecting hardware ensure safe operations. Used in various industries worldwide, it''s trusted for wind turbine, utility pole, tower construction, emergency rescue, commercial construction, and government/military operations. Every second counts in emergencies, and the Rollgliss R550 offers reliability when it matters most.', './assets/uploads/images/1120.jpg', true, 'active', false);
