INSERT INTO public.products VALUES (2702, 'Sony Alpha a6700 Mirrorless Camera Body Bundle with Shoulder Bag, 128GB SD Card, Card Reader, Corel Mac & PC Software Kit, 2X Extra Battery, Charger, Tripod, Cleaning Kit', 1567.72, '2025-04-25 07:29:13.225282', 'The Sony a6700 Mirrorless Camera seamlessly integrates Sony''s Cinema Line advancements, α-series still-image rendering, and AI recognition technology, catering to ambitious content creators. Equipped with a 26.0MP Exmor R CMOS sensor and BIONZ XR processor, it achieves 11 fps continuous stills and UHD 4K video oversampled from 6K. Packed with cinematic features such as full pixel readout and S-Cinetone, it serves as a versatile tool for creative professionals. AI-driven autofocus and image stabilization enhance clarity, while advanced rendering, diverse color options, and connectivity features contribute to its comprehensiveness. The durable magnesium alloy body, vari-angle touchscreen, and improved grip ensure both resilience and user-friendly operation.', './assets/uploads/images/1122.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2703, 'Dolphin Sigma Robotic Pool Cleaner (2024 Model) — Wi-Fi, App, Gyroscope, Weekly Timer, Waterline Cleaning & Massive Top-Loading Ultra-Fine and Standard Filters for In-Ground Swimming Pools up to 50ft', 1449.00, '2025-04-25 07:29:13.225282', 'Hassle-free clean. Easy-to-use, robotic pool cleaner equipped with an anti-tangling swivel cable, allowing Sigma to move freely around large residential pools up to 50 feet with ease. Backed by a 3 year quality assurance.', './assets/uploads/images/1123.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2704, 'Hassle-free clean. Easy-to-use, robotic pool cleaner equipped with an anti-tangling swivel cable, allowing Sigma to move freely around large residential pools up to 50 feet with ease. Backed by a 3 year quality assurance.', 1698.00, '2025-04-25 07:29:13.225282', 'The Sony a7 III stands out as a versatile camera tailored for both photography and videography across diverse professional scenarios. Boasting a cutting-edge 24.2MP Exmor R BSI CMOS sensor and BIONZ X processor, it elevates image quality, video performance, and autofocus precision. The refined body design includes an updated touchscreen LCD, enhanced EVF, extended battery life, and dual memory card slots.', './assets/uploads/images/1124.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2705, 'Lowrance ActiveTarget Explorer Portable Ice Kit', 1549.00, '2025-04-25 07:29:13.225282', 'The Explorer Series brings the ultimate in live sonar technology in one convenient pack designed to make your ice fishing experience the best it can be. The pack includes an ActiveTarget™ Live Sonar, premium Explorer Series bag and frame, Ice Transducer Pole for ActiveTarget™ Down, Forward or Scout views, a 24 Ah lithium battery with dual USB charging ports and built-in voltage meter, along with custom wiring harness, master power switch and ethernet cable.', './assets/uploads/images/1125.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2706, 'Ego Caddy V3 Golf Trolley, Smart Auto Follow Golf Bag Carrying Cart', 1799.00, '2025-04-25 07:29:13.225282', 'Introducing the Ego Caddy V3 Golf Trolley, your smart auto-follow golf bag carrying cart. Built tough to tackle any terrain, it can handle slopes up to 35 degrees without tipping over, ensuring a hassle-free golfing experience. Equipped with a large-capacity lithium battery, it lasts for 36-45 holes without interruption, so you can focus on your game. Its intelligent automatic follow mode uses advanced sensors to trail you through the course effortlessly. With a simple one-button call-back system, navigating the green has never been easier.', './assets/uploads/images/1126.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2707, '3M DBI/SALA Rollgliss 3327050 Rescue Unit, 2 carabiner, 4-Feet Anchor Sling, Rope Bag, 50-Feet', 1512.74, '2025-04-25 07:29:13.225282', 'Introducing the Rollgliss R550 Rescue and Descent Kit, a compact solution for controlled descent rescue and evacuation. With a 50-foot (16m) super static kernmantle rope, this kit includes a rescue wheel, anchor sling, carabiners, and a carrying bag for easy transport. The R550 is designed for heights up to 1,640 feet (500m) for one user or 575 feet (175m) for two users, with a maximum weight capacity of 310 pounds (141kg) for one user or 620 pounds (282kg) for two users. Its fully automatic controlled descent device ensures safe operation, making it ideal for various industries including wind turbine maintenance, construction sites, and emergency rescue services. With every second counting in emergencies, trust the reliability of DBI-SALA Rollgliss systems to get the job done efficiently.', './assets/uploads/images/1127.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2708, 'Miele Complete C3 Marin Canister HEPA Canister Vacuum Cleaner', 1500.99, '2025-04-25 07:29:13.225282', 'Introducing the Miele C3 Series, a pinnacle of design and functionality in floor care. These full-size canisters combine maximum features and efficiency for exceptional cleaning results. Crafted with durable materials like stainless steel and impact-resistant ABS plastic, the C3 series features innovative skeleton construction, making it lighter than previous models. With a 36-foot operating radius and foot pedal controls, cleaning is quick and effective. The C3 also boasts a silence motor and AirClean Sealed System for a quiet environment and cleaner air. The C3 Marin model includes an Electro Comfort electrobrush for carpets and smooth flooring, along with a Parquet Twister for gentle care of smooth surfaces. Its self-adjusting Automatic setting optimizes suction for different floor types, while a telescopic wand and long electrical cord provide a total cleaning radius of 33 feet.', './assets/uploads/images/1128.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2709, 'Rolex Oyster Perpetual 36 Automatic Chronometer Blue Dial', 8677.00, '2025-04-25 07:29:13.225282', 'Blue dial. stainless steel case with a 1 stainless steel band. Automatic movement. 100 meters / 330 feet water resistance. Fixed bezel. Oysterlock clasp. Case size 36 mm. Rolex 126000BLSO Oyster Perpetual 36 Watch.', './assets/uploads/images/1129.jpg', true, 'active', false);
