INSERT INTO public.products VALUES (2711, 'Rolex Explorer Black Dial Stainless Steel Rolex Oyster Automatic Mens Watch', 8545.00, '2025-04-25 07:29:13.225282', 'Black dial enhanced by luminous silver-tone mercedes-logo, sword, and breguet-style shape hands. Silver-tone stainless steel case with a silver-tone stainless steel rolex oyster band. Automatic movement. 100 meters / 330 feet water resistance. Fixed Domed bezel. Scratch Resistant Sapphire crystal. Solid caseback. Oysterlock clasp. Screw Down crown. Case size 39 mm x 11 mm. Band 20 mm x long. Rolex m214270-0003 Explorer Watch.', './assets/uploads/images/1131.jpg', true, 'active', false);
