INSERT INTO public.products VALUES (2713, 'Rolex Lady-Datejust 26 179174 White Dial with Diamonds Jubilee Bracelet', 8775.00, '2025-04-25 07:29:13.225282', 'Presenting a stunning timepiece with manufacturer serial numbers, a white dial adorned with diamonds, and an 18K white gold fluted bezel. This self-winding automatic watch guarantees authenticity, accompanied by a certificate of authenticity, manufacturer box, and manual. Crafted with polished and brushed steel, its jubilee bracelet complements a scratch-resistant sapphire crystal. With water resistance up to 100 meters (330 feet), the 26mm case and 6-inch adjustable bracelet are secured with a deployment buckle and screw-down caseback.', './assets/uploads/images/1133.jpg', true, 'active', false);
