INSERT INTO public.products VALUES (2720, 'OMEGA Seamaster Aqua Terra gray dial Co-Axial automatic winding back cover skeleton 150m waterproof Men watch', 8988.00, '2025-04-25 07:29:13.225282', 'In order to inherit the history of the Seamaster series, Seamaster Aqua Terra that appeared in 2002. Standard and simple style has been described as "the eternal classic" Among the watch industry, has gained popularity as synonymous with the existence of life thing of the watch. Waterproof exerts a 150M, adopting the basic equipment, such as a screw-in crown. Dial is designed to think the height of the visibility, case design is pursuing stylish. Finished its design as a watch has reached into the realm of art beyond the frame of the watch manufacturer, is a collection of OMEGA whole body that attract force what you see it as that fitted to the arm.', './assets/uploads/images/1140.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2721, 'Ulysse Nardin Marine Chronometer Automatic Men''s Watch', 8763.88, '2025-04-25 07:29:13.225282', 'The Ulysse Nardin Marine Chronometer Manufacture 43mm watch features a stainless steel case with a transparent caseback, a black rubber strap with titanium details, and a steel deployant clasp. Its white enamel dial showcases blue luminous hands and Roman numerals, with a power reserve indicator at 12 o''clock and a sub-seconds dial at 6 o''clock housing a date calendar. Powered by the in-house Caliber UN-118 movement with a silicium escapement, it offers a 60-hour power reserve. With scratch-resistant sapphire crystal and water resistance up to 200 meters, it''s a testament to precision and innovation.', './assets/uploads/images/1141.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2722, 'Omega Seamaster Planet Ocean', 8899.00, '2025-04-25 07:29:13.225282', 'Black dial. Black ceramic case with a black rubber with nylon band. Automatic movement. 600 meters / 2000 feet water resistance. Uni-directional Rotating bezel. Deployment with Push Button Release clasp. Case size 45.5 mm x 17.6 mm. Omega 215.92.46.22.01.002 Seamaster Planet Ocean Watch.', './assets/uploads/images/1142.jpg', true, 'active', false);
