INSERT INTO public.products VALUES (2724, 'Omega Diver 300M Automatic Chronometer Black Dial Men''s Watch', 8659.00, '2025-04-25 07:29:13.225282', 'Black dial. Silver-tone stainless steel case with a silver-tone stainless steel with 18kt yellow gold links band. Automatic movement. 300 meters / 1000 feet water resistance. Uni-directional Rotating bezel. Deployment with Push Button Release clasp. Case size 42 mm. Omega 210.20.42.20.01.002 Diver 300M Watch.', './assets/uploads/images/1144.jpg', true, 'active', false);
