INSERT INTO public.products VALUES (2726, 'Table Cabinets TV Stands Pedestal Display Television Bedroom TV Stands Entertainment Support Tv Sur Pied Living Room Furniture', 8791.20, '2025-04-25 07:29:13.225282', 'This TV cabinet offers durability, with smooth round edges and a large capacity drawer for versatile storage. It''s stable and sturdy, suitable for any room, and specifically designed for use as a TV cabinet. Package includes 1 TV cabinet. Please allow slight measurement differences and color variations due to manual measurement and monitor settings.', './assets/uploads/images/1146.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2727, 'Cabinet TV Stand, TV Entertainment Storage Drawer', 8933.60, '2025-04-25 07:29:13.225282', 'This TV cabinet offers durability with thick construction and smooth, rounded edges. It features a large drawer for versatile storage and boasts excellent load-bearing capacity for stability. Ideal for use in the dining room, bedroom, or living room, it provides ample storage space for various daily necessities.', './assets/uploads/images/1147.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2728, 'Office Chair Computer Chair', 8999.99, '2025-04-25 07:29:13.225282', 'This chair features fabric/PU leather upholstery and offline appointments. It has a maximum load capacity of 180 kg and includes armrests and wheels for mobility. Constructed with a metal cross and PU leather armrests, it offers a swing mechanism and 360° rotation. Seat height adjustment is achieved through a gas lift, and it''s filled with polyurethane sponge for comfort.', './assets/uploads/images/1148.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2729, 'Reactor 40 Hydraulic Autopilot', 2299.99, '2025-04-25 07:29:13.225282', 'The Reactor 40 Hydraulic Corepack features a solid-state 9 Axis AHRS, allowing flexible mounting for optimal performance and comfort onboard. It includes Garmin''s Shadow Drive Technology for seamless helm control. Sailing features like heading hold, wind hold, tack/jibe, and step turns are incorporated. Pump sold separately; Garmin offers a smart pump setup for easy sizing. Compatible with many Garmin NMEA 2000 chartplotters for additional features.', './assets/uploads/images/1149.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2730, 'JAV Smart Board 75 Interactive Whiteboard 4K Touchscreen', 2296.01, '2025-04-25 07:29:13.225282', 'Magtech Magnetic Photo Pocket Frames offer a convenient way to display your favorite pictures on metal surfaces like refrigerators or lockers. Their durable design includes a flexible magnetic backing and a heavy-duty clear cover, ensuring secure placement without the risk of falling off like acrylic frames. They come in standard sizes including 2.5" x 3.5", 4" x 6", and 5" x 7", allowing easy insertion and changing of pictures using both hands. Note that these magnets won''t adhere to non-ferromagnetic surfaces like copper, brass, aluminum, and some stainless steel.', './assets/uploads/images/1150.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2731, 'OM SYSTEM Olympus OM-1 Mark II Micro Four Thirds System Camera', 2399.99, '2025-04-25 07:29:13.225282', 'The OM SYSTEM OM-1 Mark II camera offers blazing fast speeds, advanced computational capabilities, and intuitive usability for outdoor photography. With refined features throughout, it''s a statement of excellence in capturing the wonders of nature, from breathtaking scenes to fast-paced wildlife encounters. Wherever you venture, the OM-1 Mark II delivers outstanding performance, revealing the beauty and wonder of the natural world.', './assets/uploads/images/1151.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2732, 'Rinnai i120SN Condensing Gas Boiler', 2363.03, '2025-04-25 07:29:13.225282', 'The Rinnai Condensing Gas Boiler is a compact and efficient heating solution for energy-conscious homeowners. Its stainless-steel heat exchanger and modulating wire mesh burner provide superior performance and reliability. Enjoy precise temperature control with multizone capability and connectable thermostats. The boiler features a safety child-lock and user-friendly interface, with easy temperature adjustments thanks to an outdoor reset sensor and simple parameter settings. Its space-saving design and multiple venting options offer flexible installation. With high AFUE and compatibility with natural gas or propane, it ensures optimal energy efficiency for homes, suitable for both existing and new construction projects.', './assets/uploads/images/1152.jpg', true, 'active', false);
