INSERT INTO public.products VALUES (2734, 'Series Rock Crawler Electric', 2274.09, '2025-04-25 07:29:13.225282', 'Warn Industries 9.0Rc 9000-pound Rock Crawling Winch features a low-profile design and 9000 pound pulling capacity. It includes 50-feet long and 0.375-inch wide lightweight synthetic rope and a polished aluminum hawse fairlead. The strong synthetic line of the winch features heat-resistant Nomex abrasion sleeve, high temperature urethane coating and a unique self-tightening rope attachment to keep the line secure on the drum. This winch is equipped with multi-segment cam-actuated brake, extreme-duty winch sealing, a glossy red paint job over a primer base and 360 degrees swiveling hook to make it great for competition.', './assets/uploads/images/1154.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2735, '8x16 HDbaseT 4K Matrix SWITCHER', 2299.99, '2025-04-25 07:29:13.225282', 'Introducing our 4K 8x16 HDbaseT & HDMI Matrix Switcher! Route 8 sources to 16 displays with full 4K support and HDCP2.2. Control via iOS or Android app. Included HDbaseT PoC Receivers cover up to 230ft. Simultaneous audio outputs simplify setups, like connecting Apple TVs to amplifiers. Ideal for sports bars, hotels, and more.', './assets/uploads/images/1155.jpg', true, 'active', false);
