INSERT INTO public.products VALUES (2737, 'Ewatchparts 2.30CT DIAMOND CHANNEL SET DIAMOND BEZEL', 2349.95, '2025-04-25 07:29:13.225282', 'Introducing our brand new 2.30CT Round Diamond Bezel for Rolex Datejust and President watches. This aftermarket replacement part features genuine natural diamonds, channel-set in 14K white gold. It''s compatible with 36mm cases and fits various models. Professional installation is recommended. Please refer to our measurement guide for accurate fitment', './assets/uploads/images/1157.jpg', true, 'active', false);
