INSERT INTO public.products VALUES (2739, 'GE Profile PFQ97HSPVDS 28 Inch Smart Front Load Washer', 2279.46, '2025-04-25 07:29:13.225282', 'Introducing our 2-in-1 Washer/Dryer Combo, completing large loads in about 2 hours without transferring clothes. Features a high-airflow ventless drying system for delicate items and a 4.8 cu. ft. capacity, ideal for king-size comforters. This space-saving 120V design is 50% more energy efficient and includes an intelligent dispenser for up to 32 loads. Connect to the SmartHQ™ app for convenient detergent selection and cycle updates. Energy Star Certified and ADA Compliant, with easy-to-reach lint filter and covered under multiple warranties. Dimensions: 28"W x 32"D x 46-7/10"H.', './assets/uploads/images/1159.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2740, 'NIKE Men''s Basketball Shoes', 2375.00, '2025-04-25 07:29:13.225282', 'COMFORT INSPIRED AT THE BASKET. The Jordan Jordan Superfly combines premium materials and visible Max Air cushioning for all-day comfort. Advantages: upper in leather, synthetic material or fabric according to color; foam midsole with Max Air cushioning for comfort and responsiveness; robust rubber tread for excellent traction.', './assets/uploads/images/1160.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2741, 'Roundhill Furniture Camero Platinum Fabric', 2251.66, '2025-04-25 07:29:13.225282', 'Create a casual chic living room with this camero platinum fabric 4-piece living room set. Its blissfully neutral textured light gray upholstery is accented with welted trim. Slightly rolled arms, a pillow style cushioned back, and patterned accent pillows make this sofa set complete. High-density seat cushions top sinuous Springs and a hardwood frame for a perfectly comfortable sofa that seats up to 5 people in style.', './assets/uploads/images/1161.jpg', true, 'active', false);
