INSERT INTO public.products VALUES (2743, 'GMOIUJ Men''s Suit Suit Gray Business Casual Formal Dress Gentleman Men''s Work Slim Suit Suit', 2272.15, '2025-04-25 07:29:13.225282', 'Introducing our lightweight, elegant Men''s Suit, perfect for the business gentleman. Features interior pockets, flat lapel collar, and hand-sewn details for a classic touch. Reinforced pocket connections ensure durability. Hand-sewn buttonholes and functional decorative details add sophistication. Made of wool, available in sizes 48, 50, 52, and 54. Package includes 1 Men''s Suit Cover. Notes: Asian sizing, please refer to height and weight for fit. Color may vary slightly due to lighting and monitors. Comfortable, wrinkle-resistant, and easy to care for.', './assets/uploads/images/1163.jpg', true, 'active', false);
