INSERT INTO public.products VALUES (2746, 'Smart Ultra Dolby Atmos Soundbar', 2347.00, '2025-04-25 07:29:13.225282', 'Experience immersive spatial audio with the Bose Smart Ultra Soundbar. Equipped with Dolby Atmos and TrueSpace technology, it delivers a captivating audio experience for all content types. A.I. Dialogue Mode ensures crystal-clear vocals, even during action-packed scenes. With six full-range transducers, including upward firing speakers, it fills your space with rich, enveloping sound. Easy plug-and-play setup with HDMI eARC or optical audio connection.', './assets/uploads/images/1166.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2747, 'Recognition Electronic Smart Door Lock Digital Fingerprint Security Touch Screen', 2406.56, '2025-04-25 07:29:13.225282', 'Our smart door lock offers multiple unlocking methods including fingerprint, card, and mechanical key, enhancing home security and convenience. Suitable for various door types and equipped with a built-in rechargeable battery. Fits door thickness from 35mm to 120mm and includes features like built-in doorbell, camera, and peephole. Easy to use with reversible handle direction and compatible with wooden, steel, brass, and stainless steel doors. Package includes 1 smart door lock. Note: Please allow slight measurement error and color variation due to screen differences.', './assets/uploads/images/1167.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2748, 'ProForm Pro 2000 Smart Treadmill with 10” HD Touchscreen Display', 2449.99, '2025-04-25 07:29:13.225282', 'Stream elite personal trainers into your home with the ProForm Pro 2000 smart treadmill. With a 30-day iFIT family membership, you can create up to 5 individual exercise profiles that each have access to the entire iFIT library of Live Workouts, Studio Classes, and Global Workouts. With iFIT, your trainers will auto-adjust your speed, incline, and decline to optimize your exercise and mimic real-world terrain for a fully-immersive experience in the comfort of your home. After each workout, simply fold up your treadmill deck for compact storage that helps you reclaim your living space and keep your home clutter-free.', './assets/uploads/images/1168.jpg', true, 'active', false);
