INSERT INTO public.products VALUES (2756, 'Gin and Grace 14K Two Tone Gold Genuine Morganite Ring with Diamonds for women', 1595.00, '2025-04-25 07:29:13.225282', 'This gorgeous ring is crafted of 14-karat Two Tone gold with an pear-cut Gin & Grace Genuine morganite center stone accented by sparkling diamond accents. A high polish finish gives this piece a radiant shine. Gemstone colors: Pink Gemstone shapes: Pear One prong-set oval-cut Genuine morganite weight: 2.39 carats Diamonds: 88 Diamond cut: Natural Round Diamond measurements: 1 mm Diamond weight: 0.55 carat Color: G-H Clarity: I1-I2 Setting: Prong Metal: 14k Two Tone gold Finish: High polish Metal weight: 4.82 grams Ring setting dimensions: 18 mm wide x 23 mm long x 4 mm high Band dimensions: 2 mm wide', './assets/uploads/images/1177.jpg', true, 'active', false);
