INSERT INTO public.products VALUES (2833, 'Mephisto Men''s Titouan Loafer', 288.00, '2025-04-25 07:29:13.225282', 'This versatile moccasin will adapt perfectly to all your daily needs. The detachable insole, with integrated SOFT-AIR Technology, and the SHOCK-ABSORBER, in the outsole, help to minimise impact, for a gentle, effortless walk. This leather-lined shoe guarantees unparalleled comfort and an exceptional fit.', './assets/uploads/images/1258.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2834, 'Allen Edmonds Men''s McTavish Lace-Up', 286.00, '2025-04-25 07:29:13.225282', 'The more things change, the less you need to – as long as you’re sporting classic McTavish short wingtips. No matter the dress code, the day of the week or the trend of the moment, this timeless, sophisticated design comfortably fits in wherever you want to go. The contrast stitching and split-reverse welt beautifully offset the Chromexcel uppers and the shoe’s intricate pinking and perfing details – for a look that is never out of style and never out of place.', './assets/uploads/images/1259.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2835, 'Thorogood 1957 Series 8” Waterproof Moc Toe Work Boots for Men - Soft Toe, Full-Grain Leather with Comfort Insole and Slip-Resistant Heel Outsole; EH Rated', 291.00, '2025-04-25 07:29:13.225282', 'Since 1892, Thorogood has created a legacy of industry-leading footwear, delivering safety and comfort to their customers. Thorogood work boots use the finest-sourced materials to create tough, comfortable, and supportive footwear you can trust. Thorogood is an employee-owned company making job-fitted boots inspired by the hard-working people who get the job done. Whether you’re a firefighter, public safety professional, lineman, carpenter, or anyone else who works for a living, Thorogood’s got your back, on the job - and off the job with its industry-leading designs for hunting and hiking boots.', './assets/uploads/images/1260.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2836, 'Mephisto Men''s Shark', 327.00, '2025-04-25 07:29:13.225282', 'When summer adventure calls, be ready to answer with a sandal that combines the support and comfort of a traditional shoe with unsurpassed ease and wearability. Whether you''re strapping them on to head to the mountains or just out to the mailbox, you’ll feel confident and supported every step of the way. The on and off process is a literal snap, thanks to a pair of robust straps featuring secure hook-and-loop and buckle fasteners. Airy yes, but not light on features: a purpose-built midsole and a hyper-capable outsole create a luxurious, dependable experience inside and out. It correctly cradles the anatomy of your foot while effortlessly taking on uneven terrain and distributing impacts. Experience unmatched cloud-like comfort that’ll keep you on your feet for as long as the journey lasts.', './assets/uploads/images/1261.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2837, 'Emporio Armani Men''s Chronograph Watch', 325.00, '2025-04-25 07:29:13.225282', 'This product includes Certilogo registration and authentication. Receive instant digital verification that the products you purchase from the brands you love are authentic.', './assets/uploads/images/1262.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2838, 'Allen Edmonds Men''s Mercer Street Shoe, Black, 8.5 3E US', 311.00, '2025-04-25 07:29:13.225282', 'Penny loafer. Black Milled lining. Shock form insole. Speed well - tap sole.', './assets/uploads/images/1263.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2839, 'Diesel Mr. Daddy 2.0 Men''s Watch with Oversized Chronograph Watch Dial and Stainless Steel, Silicone or Leather Band', 315.00, '2025-04-25 07:29:13.225282', 'Bold, ironic and never shy, Diesel doesn''t follow trends; it creates them. With a distinctive look and a unique voice, Diesel constantly moves style forward. Taking inspiration from military, denim and rock and roll, Diesel doesn''t follow the rules of casual watch design, preferring instead to blaze a new ground whenever possible.', './assets/uploads/images/1264.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2840, 'Persol PO2468V Round Prescription Eyewear Frames', 326.00, '2025-04-25 07:29:13.225282', 'black Havana frame with polished rim details and flex hinges.', './assets/uploads/images/1265.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2841, 'Costa Del Mar Men''s Spearo Square Sunglasses', 293.00, '2025-04-25 07:29:13.225282', 'Whether you’re in the water, on the water, or near the water, the Spearo is sleek and stylish with performance features to keep up with your long days on the water. Named for spearfishers — the silent hunters of the sea - the lightweight - yet sturdy bio-resin frames boast vented nosepads, nonslip and keeper-ready temple tips, and our integral hinge and CAM system construction for added comfort and durability. Costa Del Mar lenses are coated with 100% UV protection to help protect your eyes against harmful UV rays and reduce eye strain when worn. Each pair of Costa Del Mar sunglasses come with a cleaning cloth and case to clean, protect and store your sunglasses. Costa Del Mar products sold by authorized sellers, like , are eligible for all manufacturer warranties and guarantees. Visit the Costa Del Mar shop by clicking on the brand link above to shop the entire Costa Del Mar assortment.', './assets/uploads/images/1266.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2842, 'Nike Men''s Walking Shoe Sneaker', 321.00, '2025-04-25 07:29:13.225282', 'Nike mens Air Force 1 Low', './assets/uploads/images/1267.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2843, 'HOKA ONE ONE Mens Bondi 8 Textile Impala Mock Orange Trainers 8 US', 287.00, '2025-04-25 07:29:13.225282', 'Hoka One One Mens Bondi 8 Textile Impala Mock Orange Trainers 8 US', './assets/uploads/images/1268.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2844, 'Citizen Perpetual World Time GMT White Dial Men''s Watch CB0270-87A', 313.00, '2025-04-25 07:29:13.225282', 'White dial enhanced by silver-tone hands. Silver-tone stainless steel case with a silver-tone stainless steel band. Eco-Drive movement. 100 meters / 330 feet water resistance. Fixed bezel. Scratch Resistant Sapphire crystal. Solid caseback. Fold Over with Safety Release clasp. Case size 43 mm x 10 mm. Citizen CB0270-87A Watch.', './assets/uploads/images/1269.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2851, 'Brio Limited Edition Top Loading Water Cooler Dispenser', 174.63, '2025-04-25 07:29:13.225282', 'HOT, COLD & ROOM-TEMPERATURE WATER: When you use our water cooler dispenser you can choose between crisp cold, room-temperature and piping hot output, making it ideal for cool refreshments or toasty beverage, satisfying all your hydration needs.', './assets/uploads/images/1276.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2852, 'TWOPAGES Blackout Curtain Full Light Blocking Pinch', 175.29, '2025-04-25 07:29:13.225282', 'Comfortable: Made of plain woven cotton fabric with a blackout liner, heavyweight. These soft skin-friendly cotton curtains can block out full light. Absolutely protect your privacy and create a pitch-black sleeping environment for you, also can protect your furniture from color fading.', './assets/uploads/images/1277.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2853, '14 x 18 Medicine Cabinet Recessed, Wall Niche, Bathroom Wall Cabinet, 3-Tier, Between Studs Shelving for Drywall, BlackINSERT INTO public.products VALUES (2854, 'Vertex Ultra Lightweight Cordless Stick Vacuum with DuoClean PowerFins', 158.18, '2025-04-25 07:29:13.225282', 'The Shark Vertex combines incredible suction power with the convenience of a lightweight cordless stick. Featuring DuoClean PowerFins technology with two brushrolls, you get deep cleaning to pick up more in every pass* and a MultiFLEX wand for flexible reach and compact storage.', './assets/uploads/images/1279.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2855, 'Milwaukee Leather LKM3714 Men''s Black Club Style ''2 in 1'' Zipper Vest with Full Sleeve Hoodie and Quick Draw Pocket', 156.10, '2025-04-25 07:29:13.225282', 'Premium Thick Leather | Our premium 100% leather motorcycle vest for men is crafted with high-quality full-grain 1.1-1.2mm leather, providing superior protection and durability. The leather construction ensures excellent resistance against abrasions, adding an extra layer of safety during your rides.', './assets/uploads/images/1280.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2856, 'Womens Button Up CardiganSweater', 155.57, '2025-04-25 07:29:13.225282', '[BLANKNYC] Women''s Button Up Cardigan - Large, Contains 100% Cotton.', './assets/uploads/images/1281.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2859, 'SAS Women''s, Duo Sandal', 152.30, '2025-04-25 07:29:13.225282', 'Women''s SAS, Duo Sandal. This handcrafted sandal was specifically designed to fit and follow the actual shape of your foot for total comfort. For over 25 years the Duo has been one of SAS shoe''s most popular styles. Breathable leather or suede uppersAdjustable buckle closures for a perfect fitExclusive SAS Foot-Shape lastMicrosuede fabric covered footbedTRIPAD Technology Comfort System provides shock-absorption and support to the three main pressure points of the foot', './assets/uploads/images/1284.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2860, 'Badgley Mischka Women''s Fabia Pump', 151.50, '2025-04-25 07:29:13.225282', 'Low Heel, D''orsay Pump with Buckle OrnamentINSERT INTO public.products VALUES (2861, '10-Piece Pots and Pans', 150.23, '2025-04-25 07:29:13.225282', 'Stylish copper finish is durable and highly scratch-resistant. Heavy gauge forged aluminum construction provides outstanding even heat distribution and warp resistance. Suitable for all hobs except induction. Dishwasher suitable. Oven suitable to 450°F/240°C.', './assets/uploads/images/1286.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2862, 'Hungarian Goose Down Pillows King Size, Bed Pillows for Sleeping, Pillow for Back', 149.17, '2025-04-25 07:29:13.225282', 'Our bed pillow is designed with 3-layers, striking the perfect balance between softness and support (Inner 88% polyester; Outer 12% goose down - Minimum 90% goose down).INSERT INTO public.products VALUES (2863, 'MALOUF Z 100% Natural Talalay Latex Zoned King Pillow - High Loft Firm', 148.41, '2025-04-25 07:29:13.225282', 'Let us redefine latex - forget rubber gloves and balloons. Our proprietary process produces a resilient, responsive foam completely unlike traditional memory foam. Paired with our zoned support, which features larger pin-core holes in the center and smaller around the perimeter, the Zoned Talalay Latex Pillow cradles the head and supports the neck.', './assets/uploads/images/1288.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2864, 'Tablecloths Round Table Cloth Waterproof with Tablecloth Plain Table Cover Home Decoration Kitchen Dining Room', 176.34, '2025-04-25 07:29:13.225282', 'Made of mid-weight durable , non-slip, moderate and machine washable.', './assets/uploads/images/1289.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2865, 'DreamFit DreamComfort Microfiber StaDry Technology Cooling Bed Sheets with Elastic Corner Straps for Adjustable Bed Extra Deep Pocket up to 20 inch Crafted in USA Split California King Sheet Set Blue', 147.18, '2025-04-25 07:29:13.225282', 'DreamFit presents StaDry technology Pima Cotton Bedsheets with Pillowcase set (CRAFTED IN USA): KEY FEATURES: Colored bands - Never put your sheets on sideways. Material- Microfiber fabric. Secure Fit- 360 degree band with elastic straps. Pattern - Solid with one colored flat sheet. Patented DreamFit sheets guarantee to fit and always to stay on.', './assets/uploads/images/1290.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2866, '100% France Linen Bed Set', 145.20, '2025-04-25 07:29:13.225282', '【100% high-quality linen】:LBRO2M 100% Linen Sheet Set. Excellent moisture absorption and temperature balance function, keep cool in summer and warm in winter, ensure the comfort of sheets, which can be used in all seasons, bring you a dreamy.', './assets/uploads/images/1291.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2867, 'Mr. Coffee BVMC-PSTX95 10-Cup Optimal Brew Thermal Coffee Maker, Stainless Steel', 144.05, '2025-04-25 07:29:13.225282', 'Mr. Coffee''s 10-Cup Optimal Brew Thermal Coffee Maker is designed to extract the fullest flavor possible from your favorite roast. It boasts a high brew temperature of up to 205°. Its double-walled, stainless steel thermal carafe maintains temperature without a warming plate, which preserves your coffee''s true flavor profile.', './assets/uploads/images/1292.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2868, 'Belgium Luxury Royal Family Balance Syphon Coffee Maker', 143.00, '2025-04-25 07:29:13.225282', 'The Balancing Siphon Coffee Maker was invented back in 19th century in the Europe. The process involves using an Spirit Burner to boils the water inside the Vacuum Flask to 212° F / 100°C.', './assets/uploads/images/1293.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2869, 'Solino Home Linen Tablecloth 60 x 90 Inch – 100% Pure Linen Light Natural Tablecloth – Medium Weight Hemstitch Dining Tablecloth', 142.00, '2025-04-25 07:29:13.225282', 'Exquisite linen comes together with impeccable stitching in this gorgeous collection for everyday use. Handcrafted by skilled artisans and the colors in this collection are handpicked to match a range of upholstery and decor styles.', './assets/uploads/images/1294.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2870, 'Solino Home Linen Tablecloth', 141.03, '2025-04-25 07:29:13.225282', 'Easy Care - Machine Washable, Low Iron as Needed, Steam Iron for a crisp look.', './assets/uploads/images/1295.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2871, 'Acacia Wood Dinner & Salad Bowl Set', 131.19, '2025-04-25 07:29:13.225282', 'Bring the rich beauty and warmth of nature to your table with our premium Acacia Wood Salad Bowl Set! This 28-piece masterpiece is handcrafted from 100% natural, sustainably sourced acacia wood, ensuring unparalleled durability and elegance.', './assets/uploads/images/1296.jpg', true, 'active', false);
INSERT INTO public.products VALUES (2872, 'Charcoal Heat Insulation Alcohol Pot', 132.05, '2025-04-25 07:29:13.225282', 'Charcoal Heat Insulation Alcohol Pot', './assets/uploads/images/1297.jpg', true, 'active', false);
